import {
  EventEmitter,
  Injectable,
  OnDestroy,
  Output,
} from '@angular/core';
import {
  HttpClient,
  HttpEventType,
  HttpRequest,
  HttpResponse,
} from '@angular/common/http';
import {
  BehaviorSubject,
  Observable,
  of,
  Subject,
} from 'rxjs';
import {
  UploadProgress,
  UploadError,
  UPLOAD_ERROR_MSG,
  UploadItem,
  UPLOAD_STATUS,
  HttpRequestOptions,
  FILEUPLOAD,
} from './fileupload.constants';
import {
  catchError,
  map,
  switchMap,
  takeUntil,
} from 'rxjs/operators';

@Injectable()
export class FileUploadService implements OnDestroy {
  @Output() uploadEvent = new EventEmitter();
  @Output() downloadEvent = new EventEmitter();
  @Output() directoryDeleteEvent = new EventEmitter();

  private _internalIdIncrem = 0;
  private _fileNameMap: Map<string, UploadItem> = new Map<
    string,
    UploadItem
  >();
  private _fileMap$ = new BehaviorSubject<
    Map<string, UploadItem>
  >(new Map<string, UploadItem>());
  private _submitComplete$ = new Subject();

  public id = null;
  public multiple = false;
  public URL = '';
  public httpOptions: HttpRequestOptions = {};
  public customControl = false;
  public maxFilesize = FILEUPLOAD.MAX_FILESIZE;
  public fileMap$ = this._fileMap$.asObservable();
  public submitComplete$ = this._submitComplete$.asObservable();
  public ERROR = {
    SIZE: UPLOAD_ERROR_MSG.SIZE,
    INVALID_NAME: UPLOAD_ERROR_MSG.INVALID_NAME,
    INVALID_GENERIC: UPLOAD_ERROR_MSG.INVALID_GENERIC,
    INVALID_NETWORK: UPLOAD_ERROR_MSG.INVALID_NETWORK,
  };

  constructor(private http: HttpClient) {}

  ngOnDestroy() {
    this._fileMap$.complete();
    this._submitComplete$.complete();
  }

  public add(files: FileList, autoSubmit = false) {
    if (files && files.length > 0) {
      this._submitComplete$.next(false);

      Object.values(files)
        .slice(0, this.multiple ? files.length : 1)
        .forEach((file: File) => {
          if (!this._fileNameMap.has(file.name)) {
            this._initFileUpload(file, autoSubmit);
          }
        });

      this._fileMap$.next(this._fileNameMap);

      this.uploadEvent.emit({
        id: this.id,
        type: UPLOAD_STATUS.ADD,
        payload: this._fileNameMap,
      });

      return this._fileMap$.getValue();
    }

    return false;
  }

  public remove(fileName) {
    if (this._fileNameMap.has(fileName)) {
      const removedFile = this._fileNameMap.get(fileName);

      this._cleanupObservables(fileName);
      this._fileNameMap.delete(fileName);
      this._fileMap$.next(this._fileNameMap);

      this.uploadEvent.emit({
        id: this.id,
        type: UPLOAD_STATUS.REMOVE,
        payload: removedFile,
      });

      // need to throw this on the next microtask else the remove emit won't happen
      Promise.resolve(() => this._updateSubmitComplete());

      return this._fileMap$.getValue();
    }

    return false;
  }

  public retry(fileName) {
    if (this._fileNameMap.has(fileName)) {
      const fileInfo = this._fileNameMap.get(fileName);

      if (fileInfo.upload$) {
        this._fileNameMap.set(fileName, {
          ...fileInfo,
          uploadInit: true,
          complete: false,
          hasError: false,
        });

        this._fileMap$.next(this._fileNameMap);

        fileInfo.upload$.next({});

        this.uploadEvent.emit({
          id: this.id,
          type: UPLOAD_STATUS.RETRY,
          payload: fileInfo,
        });

        Promise.resolve(() => this._updateSubmitComplete());

        return this._fileMap$.getValue();
      }
    }

    return false;
  }

  public submit() {
    if (this._fileNameMap.size <= 0) {
      this._submitComplete$.next(true);

      return this._fileMap$.getValue();
    }

    this._fileNameMap.forEach(
      ({ upload$, progress$, hasError, file }) => {
        if (upload$ && (hasError || !progress$)) {
          this._fileNameMap.set(file.name, {
            ...this._fileNameMap.get(file.name),
            uploadInit: true,
            complete: false,
            hasError: false,
          });

          if (!this.customControl) {
            upload$.next({});
          }
        }
      }
    );

    this._fileMap$.next(this._fileNameMap);

    this.uploadEvent.emit({
      id: this.id,
      type: UPLOAD_STATUS.SUBMIT,
      payload: this._fileNameMap,
    });

    return this._fileMap$.getValue();
  }

  _initFileUpload(file, autoSubmit = false): void {
    const fileName = file.name;
    const errorMessage = this._validateFile(file);
    const hasError = errorMessage !== '';

    this._fileNameMap.set(fileName, {
      __id: ++this._internalIdIncrem,
      file,
      icon: this._getFileIconType(file),
      complete: false,
      allowRetry: false,
      uploadInit: false,
      hasError,
    });

    if (!hasError) {
      const upload$ = new Subject<any>();

      upload$
        .asObservable()
        .pipe(
          switchMap(
            (httpOptions: HttpRequestOptions = {}) => {
              this._fileNameMap.set(fileName, {
                ...this._fileNameMap.get(fileName),
                uploadInit: true,
              });

              return this._getHttpRequest(
                file,
                httpOptions
              );
            }
          )
        )
        .subscribe();

      this._fileNameMap.set(fileName, {
        ...this._fileNameMap.get(fileName),
        upload$,
      });

      if (autoSubmit && !this.customControl) {
        upload$.next();
      }
    } else {
      const error$ = new BehaviorSubject<UploadError>({
        message: errorMessage,
        error: new Error(errorMessage),
      });

      this._fileNameMap.set(fileName, {
        ...this._fileNameMap.get(fileName),
        error$: error$.asObservable(),
        complete: true,
      });

      this._updateSubmitComplete();
    }
  }

  _getHttpRequest(
    file,
    userHttpOptions: HttpRequestOptions = {}
  ): Observable<any> {
    const fileName = file.name;
    const formData = new FormData();
    const destroy$ = new Subject<boolean>();
    const error$ = new BehaviorSubject<UploadError>({
      message: '',
      error: null,
    });
    const progress$ = new BehaviorSubject<UploadProgress>({
      progress: 0,
      loaded: '0',
      total: '0',
    });

    formData.append(`userfile`, file, fileName);

    this._fileNameMap.set(fileName, {
      ...this._fileNameMap.get(fileName),
      error$: error$.asObservable(),
      progress$: progress$.asObservable(),
      destroy$,
    });

    return this.http
      .request(
        new HttpRequest('POST', this.URL, formData, {
          ...this.httpOptions,
          ...userHttpOptions,
          reportProgress: true,
        })
      )
      .pipe(
        takeUntil(destroy$),
        map((res) =>
          this._handleUploadProgress(
            res,
            fileName,
            progress$
          )
        ),
        catchError((err) =>
          this._handleUploadError(err, fileName, error$)
        )
      );
  }

  _handleUploadProgress(res, fileName, progress$) {
    const fileInfo = this._fileNameMap.get(fileName);

    if (
      res.type === HttpEventType.Sent &&
      !fileInfo.allowRetry
    ) {
      this._fileNameMap.set(fileName, {
        ...fileInfo,
        allowRetry: true,
      });
    } else if (res.type === HttpEventType.UploadProgress) {
      const progressInfo = {
        progress: Math.round(
          (100 * res.loaded) / res.total
        ),
        loaded: (res.loaded / 1000000).toFixed(2),
        total: (res.total / 1000000).toFixed(2),
      };

      progress$.next(progressInfo);

      this.uploadEvent.emit({
        id: this.id,
        type: UPLOAD_STATUS.PROGRESS,
        payload: {
          response: res,
          file: fileInfo,
          ...progressInfo,
        },
      });
    } else if (res instanceof HttpResponse) {
      this._fileUploadCompleteAction(fileName);
      this._cleanupObservables(fileName);

      this.uploadEvent.emit({
        id: this.id,
        type: UPLOAD_STATUS.COMPLETE,
        payload: fileInfo,
      });

      this._updateSubmitComplete();
    }

    return of(res);
  }

  _handleUploadError(err, fileName, error$) {
    this._fileUploadCompleteAction(fileName, true);
    const message =
      err && err.status >= 400 && err.status < 600
        ? this.ERROR.INVALID_NETWORK
        : this.ERROR.INVALID_GENERIC;

    error$.next({
      message,
      error: err,
    });

    this.uploadEvent.emit({
      id: this.id,
      type: UPLOAD_STATUS.ERROR,
      payload: {
        message,
        error: err,
        file: this._fileNameMap.get(fileName),
      },
    });

    this._updateSubmitComplete();

    return of(err);
  }

  _fileUploadCompleteAction(
    fileName: string,
    hasError = false
  ): void {
    if (this._fileNameMap.has(fileName)) {
      const fileInfo = this._fileNameMap.get(fileName);

      this._fileNameMap.set(fileName, {
        ...fileInfo,
        complete: true,
        allowRetry: !hasError ? false : fileInfo.allowRetry,
        hasError,
      });

      this._fileMap$.next(this._fileNameMap);
    }
  }

  _cleanupObservables(fileName: string): void {
    if (this._fileNameMap.has(fileName)) {
      const { upload$, destroy$ } = this._fileNameMap.get(
        fileName
      );

      if (upload$) {
        upload$.complete();
      }

      if (destroy$) {
        destroy$.next(true);
        destroy$.complete();
      }
    }
  }

  _updateSubmitComplete(): void {
    const uploadValidItemCount = this._getCountFromFileMap(
      (val) => !val.hasError
    );
    const uploadCompleteCount = this._getCountFromFileMap(
      (val) => !val.hasError && val.complete
    );
    const isComplete =
      uploadValidItemCount === 0 ||
      uploadCompleteCount === uploadValidItemCount;

    this._submitComplete$.next(isComplete);

    if (isComplete) {
      this.uploadEvent.emit({
        id: this.id,
        type: UPLOAD_STATUS.COMPLETE_ALL,
        payload: this._fileNameMap,
      });
    }
  }

  _validateFile(file: File): string {
    if (
      file.size !== 0 &&
      file.size / 1000000 > this.maxFilesize
    ) {
      return this.ERROR.SIZE;
    } else if (/[/\\<>:*"?|']/.test(file.name)) {
      return this.ERROR.INVALID_NAME;
    }

    return '';
  }

  _getFileIconType(file: File): string {
    if (!file) {
      return '';
    }

    const fileType = file.type.toLowerCase();

    if (fileType.includes('image')) {
      if (/\.(jpg|jpeg)$/i.test(file.name)) {
        return FILEUPLOAD.ICONS.JPG;
      } else if (/\.(png)$/i.test(file.name)) {
        return FILEUPLOAD.ICONS.PNG;
      } else {
        return FILEUPLOAD.ICONS.PHOTO;
      }
    } else if (fileType.includes('video')) {
      if (/\.(mov)$/i.test(file.name)) {
        return FILEUPLOAD.ICONS.MOV;
      } else if (/\.(avi)$/i.test(file.name)) {
        return FILEUPLOAD.ICONS.AVI;
      }
    } else if (fileType.includes('pdf')) {
      return FILEUPLOAD.ICONS.PDF;
    } else if (fileType.includes('json')) {
      return FILEUPLOAD.ICONS.JSON;
    } else if (
      /\.(xls|xlsx|xlsm|xlsb|)$/i.test(file.name)
    ) {
      return FILEUPLOAD.ICONS.XLS;
    } else if (/\.(xml?)$/i.test(file.name)) {
      return FILEUPLOAD.ICONS.XML;
    }

    return FILEUPLOAD.ICONS.DEFAULT;
  }

  _getCountFromFileMap(filterFn): number {
    if (filterFn) {
      return Array.from(this._fileNameMap.values()).filter(
        filterFn
      ).length;
    }
  }
}

import { Injectable, OnDestroy } from '@angular/core';
import { Subject } from 'rxjs';

@Injectable({
  providedIn: 'root',
})
export class RowSelectionService implements OnDestroy {
  _rowData = [];
  _stateChange = new Subject();
  selection = [];
  isHeaderSelected = false;

  ngOnDestroy() {
    this._stateChange.complete();
  }

  updateState(rowData, isSingle) {
    if (Array.isArray(rowData)) {
      this._rowData = rowData.slice();

      this.selection = this._rowData.filter(
        (row) => row.__rowChecked__
      );

      if (isSingle) {
        // if we find more than 1 row selected, we return the first row selection found
        if (this.selection.length > 0) {
          this.selection = [this.selection[0]];
        }
      } else {
        this.isHeaderSelected =
          this._rowData.length === this.selection.length;
      }
    }
  }

  handleHeaderSelect = () => {
    this.isHeaderSelected = !this.isHeaderSelected;
    this.selection = this.isHeaderSelected
      ? this._rowData.slice()
      : [];
    this._emitStateChange(null);
  };

  handleRowMultiSelect = (row) => {
    const selection = this.selection.slice();
    const rowIndex = selection.indexOf(row);

    if (rowIndex === -1) {
      selection.push(row);
    } else {
      selection.splice(rowIndex, 1);
    }

    this.isHeaderSelected =
      selection.length === this._rowData.length;
    this.selection = selection;
    this._emitStateChange(row);
  };

  handleRowSingleSelect = (row) => {
    const rowIndex = this.selection.indexOf(row);
    const selection = rowIndex === -1 ? [row] : [];

    this.isHeaderSelected = false;
    this.selection = selection;
    this._emitStateChange(row);
  };

  handleExpandLazySelect = (row) => {
    const rowIndex = this.selection.indexOf(row);
    const checked = rowIndex === -1;

    // we only record when we un-select for the lazy case
    if (!checked) {
      const selection = this.selection.slice();
      selection.splice(rowIndex, 1);
      this.isHeaderSelected = false;
      this.selection = selection;
    }

    this._emitStateChange(row, checked);
  };

  handleHeaderLazySelect = () => {
    const isHeaderSelected = !this.isHeaderSelected;

    // we only record when we un-select for the lazy case
    if (!isHeaderSelected) {
      this.selection = [];
    }

    this._emitStateChange(null, isHeaderSelected);
  };

  _emitStateChange(
    row,
    checked = this.selection.indexOf(row) !== -1
  ) {
    this._stateChange.next({
      row,
      checked,
      selectionArray: this.selection,
      isHeaderSelected: this.isHeaderSelected,
    });
  }
}

import {
  ApplicationRef,
  ComponentFactoryResolver,
  ComponentRef,
  EmbeddedViewRef,
  Injectable,
  Injector,
} from '@angular/core';
import {
  VISIBLE_ELEMENT_PROPS,
  KNOWN_MOBILE_DEVICES,
  MOBILE_WIDTH,
} from './vds-lib.service.constants';
import { BehaviorSubject } from 'rxjs';

@Injectable({
  providedIn: 'root',
})
export class VdsLibService {
  private UUIDs: any = {};
  private navInfo = new BehaviorSubject<any>(null);
  navInfo$ = this.navInfo.asObservable();

  constructor(
    private appRef: ApplicationRef,
    private injector: Injector,
    private componentResolver: ComponentFactoryResolver
  ) {}

  setNavInfo(navUpdateInfo: any) {
    this.navInfo.next(navUpdateInfo);
  }

  getUUID(name?: string): string {
    name = name ? name : '';
    const uuid =
      '' +
      name +
      Math.floor(Math.random() * 10).toString() +
      Math.floor(Math.random() * 10).toString() +
      Math.floor(Math.random() * 10).toString() +
      Math.floor(Math.random() * 10).toString() +
      Math.floor(Math.random() * 10).toString() +
      Math.floor(Math.random() * 10).toString();
    return this.checkUUID(uuid, name);
  }

  checkUUID(uuid: string, name?: string): string {
    if (this.UUIDs[uuid]) {
      return this.getUUID(name);
    }
    this.UUIDs[uuid] = 1;
    return uuid;
  }

  getEnumValues(someEnum: any) {
    let enumValues: Array<string> = [];
    for (let value in someEnum) {
      enumValues.push(value);
    }
    return enumValues;
  }

  getComponentRootNode(componentRef: any): HTMLElement {
    if (!componentRef.hostView) {
      return componentRef.element.nativeElement;
    }

    return (componentRef.hostView as EmbeddedViewRef<any>)
      .rootNodes[0] as HTMLElement;
  }

  insertGlobalComponent(
    componentClassOrFactory: any,
    detectionSelector?: string
  ): any {
    if (detectionSelector) {
      const existingComponentInstanceEl: HTMLElement = document.querySelector(
        detectionSelector
      );
      if (existingComponentInstanceEl) {
        return;
      }
    }
    let factory: any;
    factory = this.componentResolver.resolveComponentFactory(
      componentClassOrFactory
    );
    const componentReference: ComponentRef<
      any
    > = factory.create(this.injector);
    this.appRef.attachView(componentReference.hostView);
    const componentElReference: HTMLElement = this.getComponentRootNode(
      componentReference
    );
    document.body.appendChild(componentElReference);
    componentReference.onDestroy(() => {
      this.appRef.detachView(componentReference.hostView);
    });
    return componentReference;
  }

  triageDisabledValue(disabled): boolean {
    const disabledStr = String(disabled).toLowerCase();
    return !(
      disabledStr === 'undefined' ||
      disabledStr === 'null' ||
      disabledStr === 'false'
    );
  }

  isMobile(): boolean {
    // If user matches any known mobile device, return true
    if (this.deviceMatched()) {
      return true;
    }
    // If user window width is less than 1024px (taken from web)
    if (window.innerWidth <= MOBILE_WIDTH) {
      return true;
    }
    return false;
  }

  private deviceMatched(): boolean {
    const array: Array<string> = Object.keys(
      KNOWN_MOBILE_DEVICES
    ).map((key) => {
      return KNOWN_MOBILE_DEVICES[key];
    });
    const match = array.filter((device) => {
      navigator.userAgent.match(new RegExp(`/${device}i/`));
    });
    return match.length > 0;
  }

  getBoundingBoxAndCoords(
    element: HTMLElement,
    toggleVisibility = false
  ) {
    /*
      toggleVisibity will temporarily fiddle with CSS to ensure
      that the component is actually getting measurable layout
      properties at the time that we measure width/height
    */
    const currentCSS = {
      display: element.style.display,
      visibility: element.style.visibility,
      position: element.style.position,
    };
    if (toggleVisibility) {
      element.style.display = VISIBLE_ELEMENT_PROPS.display;
      element.style.visibility =
        VISIBLE_ELEMENT_PROPS.visibility;
      element.style.position =
        VISIBLE_ELEMENT_PROPS.position;
    }
    const boundingRect = element.getBoundingClientRect();
    const left: number = boundingRect.left;
    const top: number = boundingRect.top;
    const width: number = boundingRect.width;
    const height: number = boundingRect.height;
    if (toggleVisibility) {
      element.style.display = currentCSS.display;
      element.style.visibility = currentCSS.visibility;
      element.style.position = currentCSS.position;
    }
    return { left, top, width, height };
  }
}

