import { forwardRef } from '@angular/core';
import {
  ControlValueAccessor,
  NG_VALUE_ACCESSOR,
} from '@angular/forms';

export abstract class AbstractValueAccessor
  implements ControlValueAccessor {
  val: any = '';

  get value(): any {
    return this.val;
  }
  set value(v: any) {
    if (v !== this.val) {
      this.val = v;
      this.onChange(v);
    }
  }

  writeValue(value: any) {
    this.val = value;
    this.onChange(value);
  }

  onChange = (_) => {};

  onTouched = () => {};

  registerOnChange(fn: (_: any) => void): void {
    this.onChange = fn;
  }

  registerOnTouched(fn: () => void): void {
    this.onTouched = fn;
  }
}

export function MakeProvider(type: any) {
  return {
    provide: NG_VALUE_ACCESSOR,
    useExisting: forwardRef(() => type),
    multi: true,
  };
}

export interface Button {
  label: string;
  listboxes: Array<ListItem>;
}

export interface ListItem {
  label: string;
}

export interface NavData {
  href: string;
  component: any;
  role: 'link' | 'disclosure';
  parent: any;
}

export const NAV_DEFAULT = {
  name: 'nav',
  altText: 'Visa',
  class: {
    active: 'vds-state--selected',
    default: 'vds-tab',
  },
  menu: 'visa_menu',
  close: 'visa_close',
