import {
  Directive,
  ElementRef,
  HostListener,
  Input,
} from '@angular/core';
import { coerceBooleanProperty } from '@angular/cdk/coercion';

/**
 * BlockChildEventDirective use to block child event
 */
@Directive({
  selector: '[vdsBlockChildEvent]',
})
export class BlockChildEventDirective {
  constructor(private _element: ElementRef) {}

  private _blockEvent: boolean;
  get blockEvent(): boolean {
    return this._blockEvent;
  }
  @Input('vdsBlockChildEvent')
  set blockEvent(block: boolean) {
    this._blockEvent = coerceBooleanProperty(block);
  }

  @HostListener('click', ['$event'])
  onClick(e) {
    this.blockChildEvent(e);
  }

  @HostListener('keyup.enter', ['$event'])
  enter(e) {
    this.blockChildEvent(e);
  }

  @HostListener('keyup.space', ['$event'])
  space(e) {
    this.blockChildEvent(e);
  }

  blockChildEvent(e) {
    if (this.blockEvent) {
      e.stopPropagation();
    }
  }
}

