import {
  Directive,
  ElementRef,
  HostListener,
  AfterViewChecked,
} from '@angular/core';
import {
  DOWN_ARROW,
  END,
  HOME,
  LEFT_ARROW,
  RIGHT_ARROW,
  UP_ARROW,
} from '@angular/cdk/keycodes';
import { merge } from 'rxjs';
import { DatatableComponent } from './datatable.component';

const DATA_FOCUS_DISABLED = 'data-dg-focus-disabled';
const DATA_ROW_INDEX = 'data-dg-row-index';
const DATA_COLUMN_INDEX = 'data-dg-column-index';
const TABINDEX_SELECTOR = '[tabindex]';
const ROW_SELECTOR = '[role="row"]';
const GRID_CELL_SELECTOR = '[role="gridcell"]';
const COLUMN_HEADER_SELECTOR = '[role="columnheader"]';

function findElementWithTabIndex(element) {
  if (
    !element ||
    element.nodeName.toLowerCase() === 'table'
  ) {
    return;
  }

  if (element.matches(TABINDEX_SELECTOR)) {
    return element;
  }

  return findElementWithTabIndex(element.parentNode);
}

@Directive({
  selector: '[vdsKeyboardFocusDatatable]',
})
export class KeyboardFocusDirective
  implements AfterViewChecked {
  _focusGrid: HTMLElement[][] = null;
  _curRowIndex = 0;
  _curColumnIndex = 0;
  _updateFocusGrid = false;

  @HostListener('click', ['$event'])
  handleClick(event) {
    if (this.dataTable.loading) {
      return;
    }

    let focusElement = event.target.querySelector(
      TABINDEX_SELECTOR
    );

    if (!focusElement) {
      if (event.target.matches(TABINDEX_SELECTOR)) {
        focusElement = event.target;
      } else if (
        event.target.parentNode.matches(TABINDEX_SELECTOR)
      ) {
        focusElement = event.target.parentNode;
      } else {
        focusElement = findElementWithTabIndex(
          event.target.parentNode
        );
      }
    }

    if (
      focusElement &&
      focusElement.getAttribute(DATA_FOCUS_DISABLED) !==
        'true'
    ) {
      this._setCurFocusedElemTabIndex(
        Number(focusElement.getAttribute(DATA_ROW_INDEX)),
        Number(
          focusElement.getAttribute(DATA_COLUMN_INDEX)
        ),
        false
      );
    }
  }

  @HostListener('keydown', ['$event'])
  handleKeyDown(event): void {
    if (this.dataTable.loading) {
      return;
    }

    switch (event.which || event.keyCode) {
      case UP_ARROW:
        this._keyDownNextCellLookup(0, -1);
        break;

      case DOWN_ARROW:
        this._keyDownNextCellLookup(0, 1);
        break;

      case LEFT_ARROW:
        this._keyDownNextCellLookup(-1, 0);
        break;

      case RIGHT_ARROW:
        this._keyDownNextCellLookup(1, 0);
        break;

      case HOME:
        this._setCurFocusedElemTabIndex(
          event.ctrlKey ? 0 : this._curRowIndex,
          0
        );
        break;

      case END:
        const curRowIndex = event.ctrlKey
          ? this._focusGrid.length - 1
          : this._curRowIndex;
        this._setCurFocusedElemTabIndex(
          curRowIndex,
          this._focusGrid[curRowIndex].length - 1
        );
        break;

      default:
        return;
    }

    event.preventDefault();
  }

  constructor(
    public element: ElementRef,
    public dataTable: DatatableComponent
  ) {
    merge(
      this.dataTable.tableStateChange$,
      this.dataTable.columnStateChange$,
      this.dataTable.expandStateChange$
    ).subscribe(() => (this._updateFocusGrid = true));
  }

  ngAfterViewChecked() {
    if (this._updateFocusGrid) {
      this._updateFocusGrid = false;

      Promise.resolve().then(() => {
        this._focusGrid = this._setupFocusGrid();
        this._setCurFocusedElemTabIndex(
          this._curRowIndex,
          this._curColumnIndex,
          false
        );
      });
    }
  }

  _keyDownNextCellLookup(dirX: number, dirY: number): void {
    const rowCount = this._focusGrid.length - 1;
    const rowIndex = Math.min(
      Math.max(this._curRowIndex + dirY, 0),
      rowCount
    );
    const numberOfColumns = Math.max(
      0,
      this._focusGrid[rowIndex] &&
        this._focusGrid[rowIndex].length - 1
    );
    const columnIndex =
      numberOfColumns !== undefined
        ? Math.min(
            this._curColumnIndex + dirX,
            numberOfColumns
          )
        : -1;
    const focusElement = this._focusGrid[rowIndex][
      columnIndex
    ];
    const isFocusElementDisabled =
      focusElement &&
      focusElement.getAttribute(DATA_FOCUS_DISABLED) ===
        'true';

    if (
      focusElement === undefined ||
      isFocusElementDisabled
    ) {
      if (dirX === 0) {
        const newDirY = dirY + Math.sign(dirY);
        if (
          this._curRowIndex + newDirY >= 0 &&
          this._curRowIndex + newDirY <= rowCount
        ) {
          return this._keyDownNextCellLookup(dirX, newDirY);
        }
      } else {
        const newDirX = dirX + Math.sign(dirX);
        if (
          this._curColumnIndex + newDirX >= 0 &&
          this._curColumnIndex + newDirX <= numberOfColumns
        ) {
          return this._keyDownNextCellLookup(newDirX, dirY);
        }
      }
    }

    if (focusElement && !isFocusElementDisabled) {
      this._setCurFocusedElemTabIndex(
        rowIndex,
        columnIndex
      );
    }
  }

  _setupFocusGrid(): any[] {
    const focusGrid = [];

    Array.from(
      this.element.nativeElement.querySelectorAll(
        ROW_SELECTOR
      )
    ).forEach((tr: HTMLElement, i: number) => {
      const rowArray = [];
      tr.querySelectorAll(
        `${GRID_CELL_SELECTOR}, ${COLUMN_HEADER_SELECTOR}`
      ).forEach((column: HTMLElement, j: number) => {
        const focusableElements = column.querySelectorAll(
          TABINDEX_SELECTOR + ':not(svg)'
        );

        if (focusableElements.length > 0) {
          column.removeAttribute('tabindex');

          focusableElements.forEach(
            (focusElement: HTMLElement, k: number) => {
              focusElement.setAttribute(
                DATA_ROW_INDEX,
                i.toString()
              );
              focusElement.setAttribute(
                DATA_COLUMN_INDEX,
                (j + k).toString()
              );
              rowArray.push(focusElement);
            }
          );
        } else if (column.matches(TABINDEX_SELECTOR)) {
          column.setAttribute(DATA_ROW_INDEX, i.toString());
          column.setAttribute(
            DATA_COLUMN_INDEX,
            j.toString()
          );
          rowArray.push(column);
        }
      });

      focusGrid.push(rowArray);
    });

    return focusGrid;
  }

  _setCurFocusedElemTabIndex(
    rowIndex: number,
    columnIndex: number,
    allowFocus = true
  ): void {
    if (
      Array.isArray(this._focusGrid) &&
      this._focusGrid.length
    ) {
      if (
        this._focusGrid[this._curRowIndex] &&
        this._focusGrid[this._curRowIndex][
          this._curColumnIndex
        ]
      ) {
        this._focusGrid[this._curRowIndex][
          this._curColumnIndex
        ].setAttribute('tabindex', '-1');
      }

      this._curRowIndex = rowIndex;
      this._curColumnIndex = columnIndex;

      if (
        this._focusGrid[this._curRowIndex] &&
        this._focusGrid[this._curRowIndex][
          this._curColumnIndex
        ]
      ) {
        this._focusGrid[this._curRowIndex][
          this._curColumnIndex
        ].setAttribute('tabindex', '0');
        if (allowFocus) {
          this._focusGrid[this._curRowIndex][
            this._curColumnIndex
          ].focus();
        }
      }
    }
  }
}

import {
  Directive,
  EventEmitter,
  Input,
  OnChanges,
  OnDestroy,
  Output,
} from '@angular/core';
import {
  ColumnType,
  Sortable,
  SortDirection,
  SortFn,
} from '../datatable.constants';
import { Subject } from 'rxjs';

const isSortDirectionValid = (value: any) => {
  return (
    value !== null &&
    value !== undefined &&
    [SortDirection.ASC, SortDirection.DESC].includes(value)
  );
};

@Directive({
  selector: '[vdsSortHeader]',
})
export class SortHeaderDirective
  implements OnChanges, OnDestroy {
  @Input()
  get sortActiveId() {
    return this._sortActiveId;
  }
  set sortActiveId(value: string | number) {
    this._sortActiveId = value;
  }
  _sortActiveId: string | number = null;

  @Input()
  get sortDirection() {
    return this._sortDirection;
  }
  set sortDirection(value: SortDirection) {
    if (isSortDirectionValid(value)) {
      this._sortDirection = value;
    }
  }
  _sortDirection: SortDirection = SortDirection.ASC;

  @Input()
  get sortStart() {
    return this._sortStart;
  }
  set sortStart(value: SortDirection) {
    if (isSortDirectionValid(value)) {
      this._sortStart = value;
    }
  }
  _sortStart: SortDirection = SortDirection.ASC;

  @Output()
  sortEvent: EventEmitter<any> = new EventEmitter<any>();

  _stateChange = new Subject();
  stateChange$ = this._stateChange.asObservable();
  sortColumnType: ColumnType = null;
  sortFn: SortFn;

  ngOnChanges() {
    this._emitStateChange();
  }

  ngOnDestroy() {
    this._stateChange.complete();
  }

  sort(sortable: Sortable): void {
    this.sortDirection =
      this.sortActiveId === sortable.id
        ? this.sortDirection === SortDirection.ASC
          ? SortDirection.DESC
          : SortDirection.ASC
        : this.sortStart;
    this.sortActiveId = sortable.id;
    this.sortColumnType = sortable.type;
    this.sortFn = sortable.sortFn;

    this._emitStateChange();

    this.sortEvent.emit(this._getSortState());
  }

  _emitStateChange() {
    this._stateChange.next(this._getSortState());
  }

  _getSortState() {
    return {
      id: this.sortActiveId,
      direction: this.sortDirection,
      sortFn: this.sortFn,
      type: this.sortColumnType,
    };
  }
}

import {
  ComponentRef,
  Directive,
  ElementRef,
  HostListener,
  Input,
  OnInit,
} from '@angular/core';
import {
  Overlay,
  OverlayPositionBuilder,
  OverlayRef,
} from '@angular/cdk/overlay';
import { ComponentPortal } from '@angular/cdk/portal';

import { TooltipComponent } from './tooltip.component';
import { TOOLTIP, TooltipOption } from './tooltip.constant';

@Directive({ selector: '[vdsTooltip]' })
export class TooltipDirective implements OnInit {
  /**
   * The information and optional configuration for the
   * tooltip.
   */
  @Input('vdsTooltip') tooltipOptions:
    | TooltipOption
    | string
    | null;

  private overlayRef: OverlayRef;
  private tooltipRef: ComponentRef<TooltipComponent>;

  constructor(
    private overlay: Overlay,
    private overlayPositionBuilder: OverlayPositionBuilder,
    private elementRef: ElementRef
  ) {}

  ngOnInit(): void {
    this.setPosition();
  }

  setPosition() {
    let positionStrategy;
    let _position;
    if (!this.tooltipOptions) {
      return;
    }
    switch (typeof this.tooltipOptions) {
      case 'string':
        _position = TOOLTIP.POSITION.TOP;
        break;
      case 'object':
        switch (
          this.tooltipOptions.position.toLowerCase()
        ) {
          case 'bottom':
            _position = TOOLTIP.POSITION.BOTTOM;
            break;
          case 'left':
            _position = TOOLTIP.POSITION.LEFT;
            break;
          case 'right':
            _position = TOOLTIP.POSITION.RIGHT;
            break;
          case 'top':
          default:
            _position = TOOLTIP.POSITION.TOP;
            break;
        }
    }
    positionStrategy = this.overlayPositionBuilder
      .flexibleConnectedTo(this.elementRef)
      .withPositions([
        {
          originX: _position.originX,
          originY: _position.originY,
          overlayX: _position.overlayX,
          overlayY: _position.overlayY,
          offsetY: _position.offsetY,
          offsetX: _position.offsetX,
        },
      ]);

    this.overlayRef = this.overlay.create({
      positionStrategy,
    });
  }

  @HostListener('mouseenter')
  show() {
    if (!this.overlayRef) {
      return;
    }
    if (this.overlayRef && !this.overlayRef.hasAttached()) {
      this.tooltipRef = this.overlayRef.attach(
        new ComponentPortal(TooltipComponent)
      );
    }
    if (typeof this.tooltipOptions === 'object') {
      this.tooltipRef.instance.position = this.tooltipOptions.position;
      this.tooltipRef.instance.text = this.tooltipOptions.content;
      return;
    }
    this.tooltipRef.instance.text = this
      .tooltipOptions as string;
  }

  @HostListener('mouseleave')
  hide() {
    if (!this.overlayRef) {
      return;
    }
    this.overlayRef.detach();
  }
}

