import {
  AfterContentInit,
  Component,
  ContentChildren,
  Input,
  QueryList,
} from '@angular/core';
import { SectionComponent } from './section/section.component';
import { VdsLibService } from '../vds-lib.service';

@Component({
  selector: 'vds-accordion',
  templateUrl: './accordion.component.html',
})
export class AccordionComponent
  implements AfterContentInit {
  @ContentChildren(SectionComponent)
  sections: QueryList<SectionComponent>;

  /**
   * Disables the accordion.
   */
  @Input() disabled: boolean;

  id: string;
  iterator = 1;

  constructor(private vdsLibService: VdsLibService) {
    this.id = this.vdsLibService.getUUID();
    this.disabled = this.vdsLibService.triageDisabledValue(
      this.disabled
    );
  }

  ngAfterContentInit() {
    this.sections
      .toArray()
      .forEach((section: SectionComponent) => {
        section.change.subscribe(
          (selectedSection: SectionComponent) => {
            // No reason to call to close all the other sections if the change
            // was because the current section is closed.
            if (selectedSection.isOpen) {
              this.select(selectedSection);
            }
          }
        );
        section.headingID += `${this.id}--${this.iterator}`;
        section.bodyID += `${this.id}--${this.iterator}`;
        ++this.iterator;
      });
    if (this.disabled) {
      this.disable();
    }
  }

  /**
   * We only allow one section to be open at a time.
   * Close all other sections when we get a change event from a section.
   * @param selectedSection
   */
  select(selectedSection: SectionComponent) {
    this.sections
      .toArray()
      .forEach((section: SectionComponent) => {
        if (section !== selectedSection) {
          section.close();
        }
      });
  }

  disable() {
    this.sections
      .toArray()
      .forEach((section: SectionComponent) => {
        section.disable();
      });
  }

  enable() {
    this.sections
      .toArray()
      .forEach((section: SectionComponent) => {
        section.enable();
      });
  }
}

