import {
  Component,
  OnInit,
  Input,
  ElementRef,
} from '@angular/core';
import {
  ALERT,
  AlertActionConfig,
  AlertDetailsConfig,
  AlertMessageConfig,
  AlertType,
} from './alert.constants';
import { VdsLibService } from '../vds-lib.service';
import { Subscription } from 'rxjs';
import { NAV_DEFAULT } from '../nav/nav.constants';

@Component({
  selector: 'vds-alert',
  templateUrl: './alert.component.html',
})
export class AlertComponent implements OnInit {
  /**
   * Configure the Alert Action(s).
   */
  @Input() action: AlertActionConfig[];
  /**
   * Configure the Alert Details.
   */
  @Input() details: AlertDetailsConfig;
  /**
   * Configure the Alert Message.
   */
  @Input() message: AlertMessageConfig;

  ALERT_TYPE: typeof AlertType = AlertType;
  hasMultipleButtons: boolean;
  navSubscription: Subscription;
  slideInTimer: boolean;
  slideOutTimer: boolean;
  sideNavClosed: boolean;
  sideNavOpen: boolean;
  timerID: any;
  typeIcon: string;
  visible = false;

  constructor(
    private el: ElementRef,
    private vdsLibService: VdsLibService
  ) {}

  private setTypeIcon() {
    if (this.details && this.details.icon) {
      this.typeIcon = this.details.icon;
      return;
    }
    if (this.details && this.details.alertType) {
      switch (this.details.alertType.toLowerCase()) {
        case AlertType.WARNING:
          this.typeIcon = AlertType.WARNING;
          break;
        case AlertType.ERROR:
          this.typeIcon = AlertType.ERROR;
          break;
        case AlertType.SUCCESS:
          this.typeIcon = AlertType.SUCCESS;
          break;
        case AlertType.INFO:
        default:
          this.typeIcon = AlertType.INFO;
          break;
      }
    }
  }

  private startTimer() {
    return setTimeout(() => {
      this.hide();
    }, this.details.duration);
  }

  private destroy() {
    this.el.nativeElement.remove();
    this.navSubscription.unsubscribe();
  }

  ngOnInit() {
    this.setTypeIcon();
    if (this.details && this.details.duration) {
      this.timerID = this.startTimer();
    }
    // dependency on the Nav component having set the nav info on the service
    this.navSubscription = this.vdsLibService.navInfo$.subscribe(
      (navInfo) => {
        if (
          navInfo &&
          navInfo.orientation === NAV_DEFAULT.vertical
        ) {
          this.sideNavClosed = !navInfo.expanded;
          this.sideNavOpen = navInfo.expanded;
        }
      }
    );
  }

  show() {
    if (this.details && this.details.slideIn) {
      setTimeout(() => {
        this.visible = true;
      }, ALERT.slideInTime);
    } else {
      this.visible = true;
    }
    if (this.timerID) {
      clearTimeout(this.timerID);
    }
  }

  hide(index?: number) {
    this.visible = false;
    if (this.details && this.details.slideOut) {
      setTimeout(() => {
        this.destroy();
      }, ALERT.slideOutTime);
    } else {
      this.destroy();
    }
    if (this.timerID) {
      clearTimeout(this.timerID);
    }
    if (index === undefined) {
      return;
    }
    if (this.action[index] && this.action[index].callback) {
      this.action[index].callback();
    }
  }

  hasCallback(): boolean {
    let callback = false;
    if (this.action && this.action.length) {
      // see if there is even one that has a callback
      return this.action.some(
        (item: AlertActionConfig) => !!item.callback
      );
    }
    return callback;
  }
}

import { Component, Input, OnInit } from '@angular/core';
import { AVATAR } from './avatar.constant';

@Component({
  selector: 'vds-avatar',
  templateUrl: './avatar.component.html',
})
export class AvatarComponent implements OnInit {
  /**
   * Alternative text for screen readers when using photo or logo.
   * <code>#a11y</code>
   */
  @Input() altText: string;
  /**
   * Avatar icon for visual representation; defaults to <code>account</code>.
   */
  @Input() icon = AVATAR.ICON_DEFAULT;
  /**
   * User's name is represented in one or two character initial format.
   */
  @Input() initials: string;
  /**
   * Link providing details on the avatar.
   */
  @Input() link: string;
  /**
   * Logo content; provide url pointing to <code>assets</code> folder.
   */
  @Input() logoUrl: string;
  /**
   * Photographic content; provide url pointing to <code>assets</code> folder.
   */
  @Input() photoUrl = AVATAR.PHOTO_URL_DEFAULT;
  /**
   * Name representing the user logged in.
   */
  @Input() userName: string;

  constructor() {}

  ngOnInit() {
    if (
      (this.photoUrl !== AVATAR.PHOTO_URL_DEFAULT ||
        this.logoUrl) &&
      !this.altText
    ) {
      console.error(AVATAR.ALT_TEXT_ERROR_MSG);
      return;
    }
    if (this.initials && !this.userName) {
      console.error(AVATAR.USERNAME_ERROR_MSG);
      return;
    }
  }
}

import {
  Component,
