@Component({
  selector: 'vds-button',
  templateUrl: './button.component.html',
  styleUrls: ['./button.component.css'],
})
export class ButtonComponent
  implements OnInit, AfterViewInit {
  // https://issues.trusted.visa.com/browse/VUIANG-1215 fix
  @HostBinding('style.pointer-events')
  get pEvents(): string {
    if (this.disabled) {
      return 'none';
    }
    return 'auto';
  }
  /**
   * ARIA Label for screen readers.
   * <code>#a11y</code>
   */
  @Input() ariaLabel: string;
  /**
   * Color scheme of button. Default:
   * <code>primary. [primary|secondary|tertiary]</code>
   */
  @Input() colorScheme = BUTTON.COLOR_SCHEME.PRIMARY;
  /**
   * Accessibility label for icon button variations.
   */
  @Input() describedBy: string;
  /**
   * Disable button statically or programmatically.
   * Use as attribute or input property.
   * Default: <code>false</code>
   */
  @Input() disabled: boolean;
  /**
   * Specify for full width button.
   * Use as attribute or input property.
   * Default: <code>false</code>
   */
  @Input() isFullWidth: boolean;
  /**
   * Hyperlink URL or URL fragment.
   */
  @Input() href: string;
  /**
   * Icon for split button. Default:
   * <code>arrow-expand</code>
   */
  @Input() icon = BUTTON.ICON.DEFAULT;
  /**
   * Type of Icon. Default:
   * <code>default. [default|light|light-outline|light-tiny|light-fill
   * |dark-outline|dark-tiny]</code>
   */
  @Input() iconType = BUTTON.ICON_TYPE.DEFAULT;
  /**
   * Tag of link button. Default:
   * <code>a. [a|button|div|span]</code>
   */
  @Input() tag = BUTTON.TAG.A;
  /**
   * Default behavior of the button.
   * Set Native HTML element type.
   * Default:
   * <code>null</code>
   */
  @Input() type: ButtonType;
  /**
   * Category of button. Default:
   * <code>text. [icon|split|text]</code>
   */
  @Input() variant = BUTTON.VARIANT.TEXT;

  /**
   * The current button tag element.
   * Allows for us to set and check for focus.
   */
  @ViewChild('button') button: ElementRef;

  id: string;

  constructor(private vdsLibService: VdsLibService) {}

  ngOnInit() {
    this.id = this.vdsLibService.getUUID();
    this.disabled = this.vdsLibService.triageDisabledValue(
      this.disabled
    );
    this.isFullWidth = this.vdsLibService.triageDisabledValue(
      this.isFullWidth
    );
    this.href = this.href ? this.href : null;
    this.iconType =
      this.iconType === BUTTON.ICON_TYPE.DEFAULT
        ? BUTTON.ICON_TYPE.LIGHT_DEFAULT
        : this.iconType;

    if (
      this.variant === BUTTON.VARIANT.SPLIT &&
      (this.colorScheme !== BUTTON.COLOR_SCHEME.PRIMARY &&
        this.colorScheme !== BUTTON.COLOR_SCHEME.SECONDARY)
    ) {
      this.colorScheme = BUTTON.COLOR_SCHEME.PRIMARY;
    }
    this.checkButtonType();
  }

  ngAfterViewInit() {
    // this only works for buttons with an icon, not split buttons
    const icon = document.getElementById(this.id)
      ? (document
          .getElementById(this.id)
          .getElementsByTagName(
            'vds-icon'
          )[0] as HTMLElement)
      : null;
    if (icon) {
      icon.getAttribute('tiny')
        ? (icon.style.height = BUTTON.HEIGHT.TINY)
        : icon.getAttribute('high')
        ? (icon.style.height = BUTTON.HEIGHT.HIGH)
        : (icon.style.height = BUTTON.HEIGHT.LOW);
    }
  }

  checkButtonType() {
    if (this.type) {
      switch (this.type.toLowerCase()) {
        case ButtonType.BUTTON:
        case ButtonType.RESET:
        case ButtonType.SUBMIT:
          break;
        default:
          this.type = null;
          break;
      }
    }
  }

  /**
   * Allow consumers to set the focus on our button without knowing the structure
   * of our button elements.
   */
  setFocus(): void {
    this.button.nativeElement.focus();
  }

  /**
   * Return if our button element has the focus.
   */
  hasFocus(): boolean {
    return (
      document.activeElement === this.button.nativeElement
    );
  }
}

