export class CardExpirationComponent
  implements OnInit, OnChanges {
  /**
   * Validation error for group selects. Defaults to falsy.
   */
  @Input() get invalid(): boolean {
    return this._invalid;
  }
  set invalid(value: boolean) {
    this._invalid = coerceBooleanProperty(value);
  }
  private _invalid: boolean = false;

  /**
   * The error displayed in the case both month and year are erroneous.
   * Defaults to 'Please fill out the Card Expiration field.'.
   */
  @Input() get invalidText(): string {
    return this._invalidText;
  }
  set invalidText(value: string) {
    this._invalidText = value;
  }
  private _invalidText: string;

  /**
   * The label above the card-expiration select. Defaults  to 'Expires (MM/YY)'.
   */
  @Input() get label(): string {
    return this._label;
  }
  set label(value: string) {
    this._label = value;
  }
  private _label: string;

  @ContentChildren(SelectComponent) selects: QueryList<
    SelectComponent
  >;

  delimiter = EXPIRATION.DEFAULT.DELIMITER;
  id: string;

  constructor(private vdsLibService: VdsLibService) {}

  ngOnInit() {
    this.label = this.label
      ? this.label
      : EXPIRATION.DEFAULT.LABEL;
    this.invalidText = this.invalidText
      ? this.invalidText
      : EXPIRATION.DEFAULT.GROUP_ERROR;
    this.id = this.vdsLibService.getUUID();
  }

  ngOnChanges() {
    if (this.selects.length === 2) {
      const selectsArray = this.selects.toArray();
      const selectOne = selectsArray[0];
      const selectTwo = selectsArray[1];
      switch (this.invalid) {
        case true:
          selectOne.invalid = true;
          selectOne.groupError = true;
          selectTwo.invalid = true;
          selectTwo.groupError = true;
          break;
        case false:
        default:
          selectOne.invalid = false;
          selectTwo.invalid = false;
          selectOne.groupError = false;
          selectTwo.groupError = false;
          break;
      }
    }
  }
}

