import {
  ChangeDetectionStrategy,
  ChangeDetectorRef,
  Component,
  ElementRef,
  EventEmitter,
  HostListener,
  Input,
  OnDestroy,
  Output,
  QueryList,
  ViewChild,
  ViewChildren,
  ViewEncapsulation,
} from '@angular/core';
import { CellInputComponent } from '../cell-factory/cell-input.component';
import {
  ActiveDescendantKeyManager,
  CdkTrapFocus,
  ListKeyManagerOption,
} from '@angular/cdk/a11y';
import {
  END,
  HOME,
  SPACE,
  TAB,
} from '@angular/cdk/keycodes';

@Component({
  selector: 'vds-datatable-column-filter',
  templateUrl: './column-filter.component.html',
  changeDetection: ChangeDetectionStrategy.OnPush,
  encapsulation: ViewEncapsulation.None,
})
export class ColumnFilterComponent implements OnDestroy {
  @Input() disabled = false;

  @Input() dataSource: Array<any>;

  @Output() selectEvent = new EventEmitter<any>();

  @ViewChild(CdkTrapFocus) overlay: CdkTrapFocus;
  @ViewChildren(CellInputComponent)
  columnCheckboxes: QueryList<CellInputComponent>;
  @ViewChild('filterListbox') filterListbox: ElementRef;

  keyManager: ActiveDescendantKeyManager<
    ListKeyManagerOption
  >;

  _keyManagerIndex;
  _keyManagerFocusId;
  _isOpen = false;

  @HostListener('document:click')
  clickOut() {
    this._isOpen = false;
  }

  @HostListener('keyup.escape', ['$event'])
  handleKeyUpEscape(event) {
    if (!this.disabled && this._isOpen) {
      event.preventDefault();
      this._isOpen = false;
    }
  }

  constructor(private cdr: ChangeDetectorRef) {}

  ngOnDestroy() {
    if (this.keyManager) {
      this.keyManager.change.unsubscribe();
    }
  }

  handleButtonSelect(event) {
    event.stopPropagation();
    this._isOpen = !this._isOpen;
  }

  handleKeyDown(event) {
    const keyCode = event.which || event.keyCode;
    if (keyCode === SPACE) {
      event.preventDefault();
      const dgInputButtonComponent = this.columnCheckboxes.toArray()[
        this._keyManagerIndex
      ];
      dgInputButtonComponent.checked = !this.columnCheckboxes.toArray()[
        this._keyManagerIndex
      ].checked;
      dgInputButtonComponent.changeEvent.emit(
        this._keyManagerIndex
      );
    } else if (keyCode === HOME) {
      event.preventDefault();
      this.keyManager.setFirstItemActive();
    } else if (keyCode === END) {
      event.preventDefault();
      this.keyManager.setLastItemActive();
    } else if (keyCode === TAB) {
      if (!this.disabled && this._isOpen) {
        this._isOpen = false;
      }
    }

    this.keyManager.onKeydown(event);
  }

  handleOverlayAttach() {
    Promise.resolve().then(() => {
      this.cdr.markForCheck();
      this.__initCdkKeyManager();
    });
  }

  trackByFn(index) {
    return index;
  }

  __initCdkKeyManager() {
    if (this.keyManager) {
      this.keyManager.change.unsubscribe();
    }

    this.keyManager = new ActiveDescendantKeyManager(
      this.columnCheckboxes
    ).withWrap();
    this.keyManager.change.subscribe((value) => {
      this._keyManagerFocusId = this.columnCheckboxes.toArray()[
        value
      ].id;
      this._keyManagerIndex = value;
      this.__listItemScrollTop();
    });
    this.keyManager.setActiveItem(0);
  }

  __listItemScrollTop() {
    if (this.filterListbox && this._keyManagerIndex >= 0) {
      const target = this.filterListbox.nativeElement
        .children[this._keyManagerIndex];
      target.parentNode.scrollTop =
        target.offsetTop - target.parentNode.offsetTop;
    }
  }
}

import {
  Component,
  ChangeDetectionStrategy,
  ViewEncapsulation,
  Input,
  ViewChild,
  HostListener,
  OnInit,
  AfterViewInit,
  ContentChild,
  Output,
  EventEmitter,
  OnDestroy,
  SimpleChanges,
  OnChanges,
  ChangeDetectorRef,
} from '@angular/core';
import {
  ALT,
  BACKSPACE,
  DELETE,
  DOWN_ARROW,
  ENTER,
  ESCAPE,
  SHIFT,
  TAB,
  UP_ARROW,
} from '@angular/cdk/keycodes';
import {
  ListKeyManager,
  ListKeyManagerOption,
} from '@angular/cdk/a11y';
import {
  coerceBooleanProperty,
  coerceNumberProperty,
} from '@angular/cdk/coercion';
import { COMBOBOX } from './combobox.constants';
import { BehaviorSubject } from 'rxjs';
import { ListboxComponent } from './listbox.component';
import { InputComponent } from './input.component';
import { TemplateCellComponent } from '../custom-template/template-cell.component';
import { isValueValid, isValidString } from './utils';
import {
  ComboboxType,
  FilterFunction,
  InputKeyupEvent,
  ListItemSelectEvent,
  ListDataType,
  ListDataObject,
} from './combobox.model';
import { VdsLibService } from '../vds-lib.service';
import {
  MakeProvider,
  AbstractValueAccessor,
} from '../abstract-value-accessor';

const acceptedTypes = ['none', 'manual', 'auto', 'inline'];
const keyupKeyCodeBlock = [
  ESCAPE,
  TAB,
  ENTER,
  UP_ARROW,
  DOWN_ARROW,
  DELETE,
  ALT,
  SHIFT,
];

const validateSearchFn = (fn) => {
  const boolCheck = fn('', '');
  if (typeof boolCheck !== 'boolean') {
    throw new Error(
      'Your search function must return a boolean.'
    );
  }

  return true;
};

@Component({
  selector: 'vds-combobox',
  templateUrl: './combobox.component.html',
  changeDetection: ChangeDetectionStrategy.OnPush,
  encapsulation: ViewEncapsulation.None,
  providers: [MakeProvider(ComboboxComponent)],
})
export class ComboboxComponent extends AbstractValueAccessor
  implements OnInit, AfterViewInit, OnChanges, OnDestroy {
  _uidInput;
  _uidLabel;
  _uidListbox;
  _isExpanded = false;
  _selectItemIndex = -1;
  _ariaActiveDescendant = null;
  _listDataOrig = [];
  _errorMessage = '';
  _keyManager: ListKeyManager<ListKeyManagerOption>;
  _listDataStream = new BehaviorSubject([]);
  _selectedItem: Element;
  _displayValue: string;

  @ViewChild(ListboxComponent)
  listBoxComp: ListboxComponent;

  @ViewChild(InputComponent)
  inputComp: InputComponent;

  @ContentChild(TemplateCellComponent)
  listItemTemplate: TemplateCellComponent;

  /**
   * Fires when Input arrow button is selected. <br>
   * Returns a boolean to indicate if the Listbox is open or not. <br>
   * <code>returns boolean</code>
   */
  @Output()
  inputButtonSelectEvent = new EventEmitter<boolean>();

  /**
   * Fires when Input keyup event fires. <br>
   * Returns the event object along w/ the current. <br>
   * Input value recorded by the component. <br>
   * <code>returns InputKeyupEvent</code>
   */
  @Output()
  inputKeyupEvent = new EventEmitter<InputKeyupEvent>();

  /**
   * Fires when list option is selected. <br>
   * Returns the event object and selected list option index. <br>
   * <code>returns ListItemSelectEvent</code>
   */
  @Output()
  listItemSelectEvent = new EventEmitter<
    ListItemSelectEvent
  >();

  /**
   * Fires when list option is selected. <br>
   * Returns the selected list option input object. <br>
   * <code>returns ListDataObject</code>
   */
  @Output()
  optionChange = new EventEmitter<
    ListDataObject | string
  >();

  /**
   * Whether component is disabled <br>
   * Default: <code>false</code>
   */
  @Input()
  get disabled(): boolean {
    return this._disabled;
  }
  set disabled(value) {
    this._disabled = coerceBooleanProperty(value);
  }
  _disabled = false;

  /**
   * Whether component is readonly <br>
   * Default: <code>false</code>
   */
  @Input()
  get readOnly(): boolean {
    return this._readOnly;
  }
  set readOnly(value) {
    this._readOnly = coerceBooleanProperty(value);
  }
  _readOnly = false;

  /**
   * Choose from 'none', 'manual', 'auto', or 'inline' <br>
   * Default: <code>none</code>
   */
  @Input()
  get type(): ComboboxType {
    return this._type;
  }
  set type(value) {
    if (acceptedTypes.includes(value)) {
      this._type = value;
    }
  }
  _type: ComboboxType = 'none';

  /**
   * List item: <br>
   *   | Array\<string> <br>
   *   | Array\<ListDataObject> <br>
   * Default: <code>[]</code>
   */
  @Input()
  get listData(): ListDataType {
    return this._listData;
  }
  set listData(arry) {
    if (Array.isArray(arry)) {
      this._listData = arry;
    }
  }
  _listData = [];

  /**
   * ID for Input element <br>
   * Default: <code>null</code>
   */
  @Input()
  get inputId(): string | null {
    return this._inputId;
  }
  set inputId(value) {
    if (isValidString(value)) {
      this._inputId = value;
    }
  }
  _inputId = null;

  /**
   * ID for label element <br>
   * Default: <code>null</code>
   */
  @Input()
  get labelId(): string | null {
    return this._labelId;
  }
  set labelId(value) {
    if (isValidString(value)) {
      this._labelId = value;
    }
  }
  _labelId = null;

  /**
   * ID for ul element <br>
   * Default: <code>null</code>
   */
  @Input()
  get listboxId(): string | null {
    return this._listboxId;
  }
  set listboxId(value) {
    if (isValidString(value)) {
      this._listboxId = value;
    }
  }
  _listboxId = null;

  /**
   * Value to display for the Combobox input field <br>
   * Default: <code>''</code>
   */
  @Input()
  get value(): string {
    return this._value;
  }
  set value(value) {
    this._value = isValidString(value)
      ? value.toString()
      : '';
  }
  _value = '';

  /**
   * Label to display for the Combobox <br>
   * Default: <code>''</code>
   */
  @Input()
  get label(): string {
    return this._label;
  }
  set label(value) {
    this._label = isValidString(value)
      ? value.toString()
      : '';
  }
  _label = '';

  /**
   * Error message to display if # of Listbox suggestions is > 0 <br>
   * Default: <code>''</code>
   */
  @Input()
  get defaultError(): string {
    return this._defaultError;
  }
  set defaultError(value) {
    this._defaultError = isValidString(value)
      ? value.toString()
      : '';

    if (this._listDataStream.getValue().length > 0) {
      this._errorMessage = this._defaultError;
    }
  }
  _defaultError = '';

  /**
   * Error message to display when # of Listbox suggestions = 0. Not applicable to type="none" <br>
   * Default: <code>''</code>
   */
  @Input()
  get noMatchError(): string {
    return this._noMatchError;
  }
  set noMatchError(value) {
    this._noMatchError = isValidString(value)
      ? value.toString()
      : '';

    if (
      this._listDataStream.getValue().length === 0 &&
      this.value.length > 0
    ) {
      this._errorMessage = this._noMatchError;
    }
  }
  _noMatchError = '';

  /**
   * Time in milliseconds to debounce the Input filtering of list options <br>
   * Default: <code>0</code>
   */
  @Input()
  get inputDebounceTime(): number {
    return this._inputDebounceTime;
  }
  set inputDebounceTime(value) {
    this._inputDebounceTime = coerceNumberProperty(
      value,
      0
    );
  }
  _inputDebounceTime = 0;

  /**
   * If true, a checkmark will display for the selected list item. <br>
   * Default: <code>true</code>
   */
  @Input()
  get displaySelectCheckmark(): boolean {
    return this._displaySelectCheckmark;
  }
  set displaySelectCheckmark(value) {
    this._displaySelectCheckmark = coerceBooleanProperty(
      value
    );
  }
  _displaySelectCheckmark = true;

  /**
   * Pass in a custom filter function <br>
   */
  @Input()
  searchFn: FilterFunction = (listItem, searchTerm) =>
    listItem
      .toString()
      .toLowerCase()
      .indexOf(searchTerm.toString().toLowerCase()) === 0;

  @HostListener('document:click')
  clickOut() {
    if (this._isExpanded) {
      this.__listItemSelect(
        this._keyManager.activeItemIndex
      );
      this._isExpanded = false;
    }
  }

  constructor(
    private cdRef: ChangeDetectorRef,
    private vdsLibService: VdsLibService
  ) {
    super();
  }

  writeValue(val: any) {
    if (!val) {
      if (this._listDataOrig.slice()) {
        this._listDataStream.next(
          this._listDataOrig.slice()
        );
      }
      return;
    }
    this.value =
      isValueValid(val.value) && isValueValid(val.label)
        ? val.value
        : val;
    super.writeValue(this.value);
    // this.value = val;
    this.__selectionProcess(val);
    this.cdRef.detectChanges();
  }

  ngOnInit() {
    const nextUniqueId = this.vdsLibService.getUUID();
    this._uidInput = `vds-combobox-input-${nextUniqueId}`;
    this._uidLabel = `vds-combobox-label-${nextUniqueId}`;
    this._uidListbox = `vds-combobox-listbox-${nextUniqueId}`;

    validateSearchFn(this.searchFn);

    if (!isValidString(this.inputId)) {
      this.inputId = this._uidInput;
    }

    if (!isValueValid(this.labelId)) {
      this.labelId = this._uidLabel;
    }

    if (!isValueValid(this.listboxId)) {
      this.listboxId = this._uidListbox;
    }

    this._errorMessage = this.defaultError;
    this._listDataOrig = this.listData.slice();
    this._listDataStream.next(this._listDataOrig.slice());

    if (this.type !== 'none') {
      this._listDataStream.next(
        this.__filterListData(this.value)
      );
    }

    this.writeValue(this.value);
  }

  ngOnChanges(change: SimpleChanges) {
    if (
      change.listData &&
      !change.listData.firstChange &&
      this.type !== 'none'
    ) {
      this._listDataOrig = change.listData.currentValue.slice();
      this._listDataStream.next(this._listDataOrig.slice());
      if (isValueValid(this._displayValue)) {
        this._listDataStream.next(
          this.__filterListData(this._displayValue)
        );
        this._selectItemIndex = 0;
        this.__setErrorMessage();
        if (this._keyManager) {
          this._keyManager.setActiveItem(
            this._selectItemIndex
          );
        }
      }
    }
    if (
      change.value &&
      !change.value.firstChange &&
      this.type !== 'none'
    ) {
      this._isExpanded = false;
      this._selectItemIndex = -1;
      this._keyManager.setActiveItem(-1);
      this._listDataStream.next(
        this.__filterListData(change.value.currentValue)
      );
    }
  }

  ngAfterViewInit() {
    this._keyManager = new ListKeyManager(
      this.listBoxComp.listItems
    ).withWrap();

    this._keyManager.change.subscribe((index) => {
      const listBoxAction = () => {
        if (index > 0) {
          this.listBoxComp.setScrollTop(index);
        } else {
          this.listBoxComp.resetScrollTop();
        }
      };

      if (
        this.listBoxComp &&
        this.listBoxComp.listItems &&
        this.listBoxComp.listItems.toArray()[index] &&
        this.listBoxComp.listItems.toArray()[index]
          .nativeElement &&
        this.listBoxComp.listItems.toArray()[index]
          .nativeElement.id
      ) {
        this._ariaActiveDescendant =
          index >= 0
            ? this.listBoxComp.listItems.toArray()[index]
                .nativeElement.id
            : null;
      }

      if (this._isExpanded) {
        listBoxAction();
      } else {
        // We use a setTimeout here because a _keyManager active item index
        // can be set when the Listbox has not displayed yet, causing issues w/ scrollTop positions.
        // This is only necessary, and called, when the Listbox is displayed after being hidden.
        setTimeout(() => listBoxAction(), 0);
      }
    });
  }

  ngOnDestroy() {
    if (this._keyManager && this._keyManager.change) {
      this._keyManager.change.unsubscribe();
    }
  }

  handleInputButtonSelect() {
    const isExpanded = !this._isExpanded;

    if (!isExpanded) {
      this.__listItemSelect(
        this._keyManager.activeItemIndex
      );
    } else if (
      this._keyManager.activeItemIndex < 0 &&
      this._keyManager.activeItemIndex !== -100
    ) {
      // -100 is an arbitrary negative number; it just needs to be
      // something other than -1 which is set from the keydown handler
      this._keyManager.setActiveItem(-100);
    }

    // it is required that _isExpanded is set AFTER _keyManager has set an
    // active item index so that setTimeout correctly fires during _keyManager.change
    this._isExpanded = isExpanded;
    this.inputButtonSelectEvent.emit(this._isExpanded);
  }

  handleInputKeydown(event) {
    const keyCode = event.which;
    if (keyCode === UP_ARROW || keyCode === DOWN_ARROW) {
      const listDataArray = this._listDataStream.getValue();
      event.preventDefault();

      if (
        event.altKey &&
        keyCode === UP_ARROW &&
        this._isExpanded
      ) {
        // ALT + UP ARROW to close
        this._isExpanded = false;
        return;
      } else if (
        event.altKey &&
        keyCode === DOWN_ARROW &&
        !this._isExpanded &&
        listDataArray.length > 0
      ) {
        // ALT + DOWN ARROW to open
        this._isExpanded = true;
        this._keyManager.setActiveItem(-1);
        return;
      } else if (
        !this._isExpanded &&
        listDataArray.length > 0
      ) {
        // UP ARROW/DOWN ARROW to open
        const activeIndex =
          this._selectItemIndex >= 0
            ? this._selectItemIndex
            : keyCode === UP_ARROW
            ? listDataArray.length - 1
            : 0;

        this._keyManager.setActiveItem(activeIndex);
        this.__typeAutoInlineAction();
        // it is required that _isExpanded is set AFTER _keyManager has set an
        // active item index so that setTimeout correctly fires during _keyManager.change
        this._isExpanded = true;
        return;
      } else if (listDataArray.length === 0) {
        // NOOP
        return;
      }

      // UP ARROW/DOWN ARROW to cycle
      this._keyManager.onKeydown(event);
      this.__typeAutoInlineAction();
      return;
    } else if (keyCode === ENTER && this._isExpanded) {
      // Handle ENTER
      event.preventDefault();
      this.toggleListBoxClasses(
        this._keyManager.activeItem
      );
      this.__listItemSelect(
        this._keyManager.activeItemIndex
      );
      this._isExpanded = false;
      this.listItemSelectEvent.emit({
        event,
        index: this._selectItemIndex,
      });
      if (this._keyManager.activeItem) {
        this.optionChange.emit(
          this._selectedItem.textContent
        );
      } else {
        this.writeValue(this.value);
        this.optionChange.emit(this.value);
      }
      return;
    } else if (keyCode === TAB && this._isExpanded) {
      // TAB to close
      this._isExpanded = false;
    } else if (keyCode === ESCAPE) {
      // ESCAPE to close
      this.value = '';
      this._isExpanded = false;
      this._selectItemIndex = -1;
      this._keyManager.setActiveItem(-1);
      this._errorMessage = this.defaultError;
      this.toggleListBoxClasses(null);

      if (this.type !== 'none') {
        this._listDataStream.next(this._listDataOrig);
      }
    }
  }

  handleInputKeyup(event) {
    const keyCode = event.which;
    if (keyupKeyCodeBlock.includes(keyCode)) {
      event.preventDefault();
      return;
    }

    const previousValue = this.value;
    this.value = event.target.value;
    const hasValueChanged =
      previousValue.toLowerCase() !==
      this.value.toLowerCase();

    this._selectItemIndex = hasValueChanged
      ? -1
      : this._selectItemIndex;
    let highlightIndex = hasValueChanged
      ? -1
      : this._keyManager.activeItemIndex;
    let isExpanded =
      this._listDataStream.getValue().length > 0;

    if (this.type !== 'none') {
      const validValue = this.value.trim() !== '';
      const filteredData = this.__filterListData(
        this.value
      );
      isExpanded = filteredData.length > 0;

      this._listDataStream.next(
        validValue && isExpanded
          ? filteredData
          : this._listDataOrig
      );

      // For type `auto` and `inline` we always select first option in filtered list
      if (hasValueChanged) {
        this._selectItemIndex = highlightIndex =
          this.type !== 'manual' && validValue && isExpanded
            ? 0
            : -1;
      }

      this.__setErrorMessage();

      if (
        this.type === 'inline' &&
        keyCode !== BACKSPACE &&
        isExpanded
      ) {
        const listValue = isValueValid(
          filteredData[0].value
        )
          ? filteredData[0].value
          : filteredData[0];

        if (this.value !== listValue) {
          const previousInputLen = this.value.length;
          event.target.value = this.value = listValue;
          this.writeValue(this.value);
          // We use a setTimeout for cross-browser support
          // Safari 12.1.1 for example will not set the selection range w/out the timeout
          setTimeout(() => {
            event.target.setSelectionRange(
              previousInputLen,
              listValue.length
            );
          }, 0);
        }
      }
    }

    if (hasValueChanged) {
      this._keyManager.setActiveItem(highlightIndex);
      this.writeValue(this.value);
      this.toggleListBoxClasses(null);
    }

    // it is required that _isExpanded is set AFTER _keyManager has set an
    // active item index so that setTimeout correctly fires during _keyManager.change
    this._isExpanded = isExpanded;
    this.inputKeyupEvent.emit({
      event,
      value: this.value,
    });
  }

  handleItemSelect(ev) {
    this.toggleListBoxClasses(ev.event.currentTarget);
    this.__listItemSelect(ev.index);
    this._isExpanded = false;
    this.listItemSelectEvent.emit({
      event: ev.event,
      index: ev.index,
    });
    this.optionChange.emit(ev.data);
  }

  toggleListBoxClasses(target) {
    if (this._selectedItem) {
      this._selectedItem.className =
        COMBOBOX.CLASSES.DEFAULT;
    }
    if (target) {
      this._selectedItem = target.nativeElement
        ? target.nativeElement
        : target;
      this._selectedItem.className =
        COMBOBOX.CLASSES.SELECTED;
    }
  }

  __filterListData(searchTerm) {
    return this._listDataOrig.filter((item) => {
      item =
        isValueValid(item.value) && isValueValid(item.label)
          ? item.label
          : item;
      return this.searchFn(item, searchTerm);
    });
  }

  __selectionProcess(currentVal) {
    this._displayValue =
      currentVal &&
      currentVal.label &&
      isValueValid(currentVal.label)
        ? currentVal.label
        : currentVal;
    if (
      this.type !== 'none' &&
      isValueValid(this._displayValue)
    ) {
      this._listDataStream.next(
        this.__filterListData(this._displayValue)
      );
      this._selectItemIndex = 0;
      this.__setErrorMessage();
      if (this._keyManager) {
        this._keyManager.setActiveItem(
          this._selectItemIndex
        );
      }
    }
  }

  __listItemSelect(itemIndex) {
    if (itemIndex >= 0) {
      const listItemData = this._listDataStream.getValue()[
        itemIndex
      ];
      this._displayValue = isValueValid(listItemData.label)
        ? listItemData.label
        : listItemData;
      this.value = isValueValid(listItemData.value)
        ? listItemData.value
        : listItemData;
      // this.writeValue(this.value);
      this.writeValue(listItemData);
      if (this.type !== 'none') {
        this._listDataStream.next(
          this.__filterListData(this._displayValue)
        );
        this._selectItemIndex = 0;
      } else {
        this._selectItemIndex = itemIndex;
      }

      this.__setErrorMessage();
      this._keyManager.setActiveItem(this._selectItemIndex);
    }
  }

  __setErrorMessage() {
    if (this._displayValue == null) {
      return;
    }
    const validValue = this._displayValue.trim() !== '';
    const filteredData = this.__filterListData(
      this._displayValue
    );
    this._errorMessage =
      validValue && filteredData.length === 0
        ? this.noMatchError
        : this.defaultError;
  }

  __typeAutoInlineAction() {
    if (this.type === 'auto' || this.type === 'inline') {
      this._selectItemIndex = this._keyManager.activeItemIndex;

      if (this.type === 'inline') {
        const listItemData = this._listDataStream.getValue()[
          this._selectItemIndex
        ];
        this.value = isValueValid(listItemData.value)
          ? listItemData.value
          : listItemData;
        this.writeValue(this.value);
      }
    }
  }

  __getInputAriaAutocomplete() {
    if (this.type === 'inline') {
      return 'both';
    }

    return 'list';
  }
}

