import {
  AfterViewInit,
  Component,
  ContentChild,
  Input,
  QueryList,
  TemplateRef,
  ViewChildren,
} from '@angular/core';
import { LocationStrategy } from '@angular/common';
import { ButtonComponent } from '../button/button.component';

import {
  DialogActionConfig,
  DialogType,
  DialogVariant,
} from './dialog.constant';

@Component({
  selector: 'vds-dialog',
  templateUrl: './dialog.component.html',
})
export class DialogComponent implements AfterViewInit {
  @ContentChild(ButtonComponent)
  firstButton: ButtonComponent;
  @ViewChildren('actionButton') actionButton: QueryList<
    ButtonComponent
  >;
  /**
   * Id of dialog.
   */
  @Input() id: string;
  /**
   * Type of dialog. Default:
   * <code>call-to-action. [call-to-action|closeable]</code>
   */
  @Input() variant = DialogVariant.CALL_TO_ACTION;
  /**
   * Type of dialog messaging. Default:
   * <code>default. [error|default|success|warning]</code>
   */
  @Input() messageType = DialogType.DEFAULT;
  /**
   * Modal header
   */
  @Input() title: string;
  /**
   * Modal content or body
   */
  @ContentChild(TemplateRef)
  dialogBodyTemplate: TemplateRef<any>;
  /**
   * Modal actions
   */
  @Input() action: DialogActionConfig[];

  public isOpen = false;
  private previouslyFocusedElement: Element | null;
  private firstFocusableElement: ButtonComponent | null;

  constructor(private location: LocationStrategy) {
    location.onPopState(() => this.hide());
  }

  ngAfterViewInit() {
    this.firstFocusableElement = this.actionButton.first;
    if (this.firstFocusableElement) {
      // This will find the nested span element inside of the vds-button.
      // Maybe we should just have a set focus method on vds button and delegate
      // that responsibility to the component instead?
      // This is presuming too much knowledge about the structure of the button
      // component.
      (this
        .firstFocusableElement as ButtonComponent).setFocus();
    }
  }

  /**
   * We only care about circulating back and forth. Like a circle.
   * We address only the first and last and ignore all in between.
   * @param event
   */
  tabFocus(event) {
    if (event.keyCode === 9 || event.key === 'Tab') {
      // if shift + tab is pressed
      if (event.shiftKey) {
        if (this.actionButton.first.hasFocus()) {
          event.preventDefault();
          this.actionButton.last.setFocus();
        }
      } else {
        if (this.actionButton.last.hasFocus()) {
          event.preventDefault();
          this.actionButton.first.setFocus();
        }
      }
    } else if (
      event.key === 'Esc' ||
      event.keyCode === 27
    ) {
      this.hide();
    }
  }

  show() {
    this.previouslyFocusedElement = document.activeElement;
    this.isOpen = true;
  }

  hide(index?: number) {
    this.isOpen = false;
    const previousFocusElement = this
      .previouslyFocusedElement as HTMLElement;
    if (previousFocusElement) {
      previousFocusElement.focus();
    }
    if (index === undefined) {
      return;
    }
    if (this.action[index] && this.action[index].callback) {
      this.action[index].callback();
    }
  }
}

import {
  Component,
  OnInit,
  ViewEncapsulation,
  ContentChild,
  Input,
  ViewContainerRef,
  AfterContentInit,
  ChangeDetectorRef,
  ChangeDetectionStrategy,
  TemplateRef,
  OnDestroy,
  Output,
  EventEmitter,
} from '@angular/core';
import { TemplatePortal } from '@angular/cdk/portal';
import { coerceBooleanProperty } from '@angular/cdk/coercion';
import { Observable, BehaviorSubject } from 'rxjs';
import {
  distinctUntilChanged,
  filter,
  take,
} from 'rxjs/operators';
import { DisclosureLazyContentDirective } from './disclosure-lazy-content.directive';
import { DisclosureHeaderComponent } from './disclosure-header/disclosure-header.component';
import { DisclosureContentDirective } from './disclosure-content.directive';
import { VdsLibService } from '../vds-lib.service';
import {
  DisclosureContainerConfig,
  DisclosureContentConfig,
  DISCLOSURE_ID_PREFIX,
} from './disclosure.constants';
/**
 * DisclosureComponent use DisclosureHeaderComponent controls the visibility of content.
 * It can have use either DisclosureContentDirective or DisclosureLazyContentDirective
 */

@Component({
  selector: 'vds-disclosure',
  templateUrl: './disclosure.component.html',
  encapsulation: ViewEncapsulation.None,
  changeDetection: ChangeDetectionStrategy.OnPush,
})
export class DisclosureComponent
  implements OnInit, AfterContentInit, OnDestroy {
  /**
   * Whether disclosure is expanded <br>
   * Default: <code>false</code>
   */
  @Input()
  get isExpanded(): boolean {
    return this._expanded;
  }
  set isExpanded(expanded: boolean) {
    this._expanded = coerceBooleanProperty(expanded);
    if (this._panelHeader) {
      this._panelHeader.isOpen = this.isExpanded;
    }
    if (expanded) {
      this.lazyContentLoadedSubject.next(true);
    }
  }
  private _expanded = false;

  /**
   * Whether disclosure is disabled <br>
   * Default: <code>false</code>
   */
  @Input()
  get isDisabled(): boolean {
    return this._isDisabled;
  }
  set isDisabled(disabled: boolean) {
    this._isDisabled = coerceBooleanProperty(disabled);
    if (this._panelHeader) {
      this._panelHeader.disabled = this.isDisabled;
    }
  }
  private _isDisabled = false;

  /**
   * Whether disclosure is lazyLoading <br>
   * Default: <code>false</code>
   */
  @Input()
  get isLazyLoading(): boolean {
    return this._isLazyLoading;
  }

  set isLazyLoading(isLazy: boolean) {
    this._isLazyLoading = coerceBooleanProperty(isLazy);
  }
  private _isLazyLoading = false;

  /**
   * provide id, extra class to disclosure container <br>
   * Default: <code>null</code>
   */
  @Input()
  get containerProps(): DisclosureContainerConfig {
    return this._containerProps;
  }
  set containerProps(props: DisclosureContainerConfig) {
    this._containerProps = {
      ...this._containerProps,
      ...props,
    };
  }
  private _containerProps: DisclosureContainerConfig;

  /**
   * provide id, extra class to disclosure content <br>
   * Default: <code>null</code>
   */
  @Input()
  get contentProps(): DisclosureContentConfig {
    return this._contentProps;
  }
  set contentProps(props: DisclosureContentConfig) {
    this._contentProps = {
      ...this._contentProps,
      ...props,
    };
    if (
      this._contentProps &&
      this._contentProps.id &&
      this._panelHeader
    ) {
      this._panelHeader.ariaControls = this._contentProps.id;
    }
  }
  private _contentProps: DisclosureContentConfig;

  /**
   * Fires when header is clicked. <br>
   * Returns the boolean to indicate the open state of disclosure
   */
  @Output() toggleHeader = new EventEmitter<boolean>();

  lazyContentLoadedSubject: BehaviorSubject<
    boolean
  > = new BehaviorSubject<boolean>(false);
  lazyContentLoaded$: Observable<
    boolean
  > = this.lazyContentLoadedSubject.asObservable();

  @ContentChild(DisclosureHeaderComponent)
  _panelHeader: DisclosureHeaderComponent;

  /** Content that will be rendered lazily. */
  @ContentChild(DisclosureLazyContentDirective)
  _lazyContent: DisclosureLazyContentDirective;

  @ContentChild(DisclosureContentDirective, {
    read: TemplateRef,
  })
  contentDirective: DisclosureContentDirective;

  _portal: TemplatePortal;

  constructor(
    private _viewContainerRef: ViewContainerRef,
    private _changeDetectorRef: ChangeDetectorRef,
    private vdsLibService: VdsLibService
  ) {}

  ngOnInit() {
    if (!this.containerProps || !this.containerProps.id) {
      const uuid = this.vdsLibService.getUUID(
        DISCLOSURE_ID_PREFIX
      );
      if (!this.containerProps) {
        this.containerProps = {};
      }
      this.containerProps.id = uuid;
    }
  }

  ngAfterContentInit() {
    if (this._lazyContent) {
      this.lazyContentLoaded$
        .pipe(
          distinctUntilChanged(),
          filter(() => {
            return this.isExpanded && !this._portal;
          }),
          take(1)
        )
        .subscribe(() => {
          this._portal = new TemplatePortal(
            this._lazyContent._template,
            this._viewContainerRef
          );
        });
    }

    if (this._panelHeader) {
      this._panelHeader.isOpen = this.isExpanded;
      this._panelHeader.disabled = this.isDisabled;
      if (this._contentProps && this._contentProps.id) {
        this._panelHeader.ariaControls = this._contentProps.id;
      }

      this._panelHeader.toggleEventState$.subscribe(() => {
        if (!this.isDisabled) {
          this.isExpanded = !this.isExpanded;
          this.toggleHeader.emit(this.isExpanded);
          this._changeDetectorRef.markForCheck();
        }
      });
    }
  }

  ngOnDestroy() {
    this.lazyContentLoadedSubject.complete();
  }
}

import {
  Component,
  OnInit,
  OnDestroy,
  Input,
  ViewEncapsulation,
  ChangeDetectionStrategy,
  ChangeDetectorRef,
  ViewChild,
  ElementRef,
} from '@angular/core';
import { coerceBooleanProperty } from '@angular/cdk/coercion';
import { Subject } from 'rxjs';
import { DisclosureHeaderConfig } from '../disclosure.constants';
/**
 * DisclosureHeaderComponent is a clickable component which controls visibility of content
 */
@Component({
  selector: 'vds-disclosure-header',
  templateUrl: './disclosure-header.component.html',
  encapsulation: ViewEncapsulation.None,
  changeDetection: ChangeDetectionStrategy.OnPush,
})
export class DisclosureHeaderComponent
  implements OnInit, OnDestroy {
  /**
   * Whether disclosure is open <br>
   * Default: <code>false</code>
   */
  @Input()
  get isOpen(): boolean {
    return this._isOpen;
  }
  set isOpen(open: boolean) {
    this._isOpen = coerceBooleanProperty(open);
  }
  _isOpen = false;

  /**
   * Whether disclosure icon is diplayed <br>
   * Default: <code>true</code>
   */
  @Input()
  get showIcon(): boolean {
    return this._showIcon;
  }
  set showIcon(show: boolean) {
    this._showIcon = coerceBooleanProperty(show);
  }
  _showIcon = true;

  /**
   * Whether disclosure is disabled <br>
   * Default: <code>false</code>
   */
  @Input()
  get disabled(): boolean {
    return this._disabled;
  }
  set disabled(disabled: boolean) {
    this._disabled = coerceBooleanProperty(disabled);
    this._changeDetectorRef.markForCheck();
  }
  _disabled = false;

  /**
   * aria-controls for disclosure <br>
   * Default: <code>null</code>
   */
  @Input()
  get ariaControls(): string {
    return this._ariaControls;
  }
  set ariaControls(control: string) {
    this._ariaControls = control;
  }
  _ariaControls: string = null;

  /**
   * Header props for disclosure <br>
   * Default: <code> {
   *   iconType: 'tiny',
   *   openIcon: 'disclosure-collapse',
   *   closeIcon: 'disclosure-expand',
   *   iconRight: false
   * } </code>
   */
  @Input()
  get headerProps(): DisclosureHeaderConfig {
    return this._headerProps;
  }
  set headerProps(props: DisclosureHeaderConfig) {
    this._headerProps = { ...this._headerProps, ...props };
  }
  _headerProps: DisclosureHeaderConfig = {
    iconType: 'tiny',
    openIcon: 'disclosure-collapse',
    closeIcon: 'disclosure-expand',
  };

  /**
   * Whether disclosure should block child component event<br>
   * Default: <code>true</code>
   */
  @Input()
  get blockChildEvent(): boolean {
    return this._blockChildEvent;
  }
  set blockChildEvent(block: boolean) {
    this._blockChildEvent = coerceBooleanProperty(block);
  }
  _blockChildEvent = false;

  /**
   * focus header after click<br>
   * Default: <code>false</code>
   */
  @Input()
  get focusHeaderAfterClick(): boolean {
    return this._focusHeader;
  }
  set focusHeaderAfterClick(focus: boolean) {
    this._focusHeader = coerceBooleanProperty(focus);
  }
  _focusHeader = false;

  constructor(
    private _changeDetectorRef: ChangeDetectorRef
  ) {}

  toggleEvent: Subject<void> = new Subject<void>();
  public toggleEventState$ = this.toggleEvent.asObservable();

  @ViewChild('header') el: ElementRef;

  ngOnInit() {}

  ngOnDestroy() {
    this.toggleEvent.complete();
  }

  toggleHeader() {
    this.toggleEvent.next();
    if (this.focusHeaderAfterClick) {
      this.el.nativeElement.focus();
    }
  }

  handleEscape() {
    if (this.isOpen) {
      this.toggleEvent.next();
    }
  }
}

