import {
  Component,
  OnInit,
  QueryList,
  ContentChildren,
  AfterContentInit,
  EventEmitter,
  Output,
  Input,
} from '@angular/core';
import { DrawerComponent } from '../drawer/drawer.component';
import { ARROW_ICON } from './dresser.constants';
import { coerceBooleanProperty } from '@angular/cdk/coercion';

@Component({
  selector: 'vds-dresser',
  templateUrl: './dresser.component.html',
})
export class DresserComponent implements AfterContentInit {
  @ContentChildren(DrawerComponent) drawers: QueryList<
    DrawerComponent
  >;
  /**
   * Emits close action to panel.
   */
  @Output() close: EventEmitter<any> = new EventEmitter();
  /**
   * Emits open action to panel.
   */
  @Output() open: EventEmitter<any> = new EventEmitter();
  /**
   * If set to true, opens the panel.
   */
  @Input()
  get isOpen(): boolean {
    return this._isOpen;
  }
  set isOpen(value) {
    this._isOpen = coerceBooleanProperty(value);
  }
  private _isOpen = false;

  /**
   * 0 based index of the drawer to be opened by default.
   */
  @Input() selectedDrawerIndex = 0;

  _drawers: Array<DrawerComponent>;
  _selectedDrawer: DrawerComponent;
  ICONS = ARROW_ICON;
  constructor() {}

  ngAfterContentInit() {
    if (this.drawers) {
      this._drawers = this.drawers.toArray();

      // trigger open event if initial value of isOpen = true
      if (
        this.isOpen &&
        this.selectedDrawerIndex >= 0 &&
        this.selectedDrawerIndex < this._drawers.length
      ) {
        this.triggerOpen(this.selectedDrawerIndex);
      }
    }
  }

  select(drawer: DrawerComponent) {
    if (this._selectedDrawer) {
      this._selectedDrawer.isSelected = false;
    }
    drawer.isSelected = true;
    this._selectedDrawer = drawer;
  }

  triggerOpen(drawerIndex: number) {
    this.isOpen = true;
    this.select(this._drawers[drawerIndex]);
    this.selectedDrawerIndex = drawerIndex;
    this.open.emit(this._drawers[drawerIndex]);
  }

  triggerClose() {
    this.isOpen = false;
    this.close.emit();
  }

  toggle() {
    this.isOpen = !this.isOpen;
    if (this.isOpen) {
      this.triggerOpen(this.selectedDrawerIndex);
      return;
    }
    this.triggerClose();
    if (this._selectedDrawer) {
      this._selectedDrawer.isSelected = false;
    }
    this._selectedDrawer = null;
  }
}

