  get URL(): string | null {
    return this._URL;
  }
  set URL(value) {
    if (isValidString(value)) {
      this._URL = value;
    }
  }
  _URL = null;

  /**
   * HTTP Options to accompany request <br>
   * Default: <code>null</code>
   */
  @Input()
  get httpOptions(): HttpRequestOptions {
    return this._httpOptions;
  }
  set httpOptions(value) {
    this._httpOptions = value;
  }
  _httpOptions = {};

  /**
   * Fires an UPLOAD_STATUS returning a payload when user performs an action <br>
   */
  @Output() uploadEvent;
  /**
   * Returns an UploadItem when selected for your App to wire up <br>
   */
  @Output() downloadEvent;
  /**
   * Returns an UploadItem when selected for your App to wire up <br>
   */
  @Output() directoryDeleteEvent;

  @ContentChild(TemplateContainerComponent)
  templateContainer: TemplateContainerComponent;

  _templateMap: Map<string, TemplateRef<any>> = new Map();
  _uploadStatus$;
  _uploadSubmitComplete$;
  _submitStream = new Subject();
  _submitDisabled = true;
  _btnActionId = FILEUPLOAD.TEMPLATES.BUTTON_ACTION;
  _listItemtId = FILEUPLOAD.TEMPLATES.LIST_ITEM;

  constructor(
    private vdsLibService: VdsLibService,
    public uploadService: FileUploadService
  ) {
    this.uploadEvent = this.uploadService.uploadEvent;
    this.downloadEvent = this.uploadService.downloadEvent;
    this.directoryDeleteEvent = this.uploadService.directoryDeleteEvent;
  }

  ngOnInit() {
    this.uploadService.ERROR = {
      SIZE: this.errorSize,
      INVALID_GENERIC: this.errorInvalidGeneric,
      INVALID_NAME: this.errorInvalidName,
      INVALID_NETWORK: this.errorInvalidNetwork,
    };
    if (!isValidString(this.formId)) {
      this.formId = `vds-fileupload-${this.vdsLibService.getUUID()}`;
    }

    this.uploadService.multiple = this.multipleUpload;
    this.uploadService.customControl = this.customControl;
    this.uploadService.maxFilesize = this.maxFilesize;
    this.uploadService.URL = this.URL;
    this.uploadService.httpOptions = this.httpOptions;
    this.uploadService.id = this.formId;

    this.disabled = this.vdsLibService.triageDisabledValue(
      this.disabled
    );

    this.customControl = this.vdsLibService.triageDisabledValue(
      this.customControl
    );

    this.enableMiniTheme = this.vdsLibService.triageDisabledValue(
      this.enableMiniTheme
    );

    this.enableDropzone = this.vdsLibService.triageDisabledValue(
      this.enableDropzone
    );

    this.enableForm = this.vdsLibService.triageDisabledValue(
      this.enableForm
    );

    this._uploadStatus$ = this.uploadService.uploadEvent.subscribe(
      ({ type }: UploadEvent) => {
        if (type === UPLOAD_STATUS.ADD) {
          this._submitDisabled = false;
        }
      }
    );

    this._uploadSubmitComplete$ = this.uploadService.submitComplete$.subscribe(
      (complete: boolean) => {
        if (complete) {
          if (this.enableForm) {
            this.disabled = false;
          }

          this._submitDisabled = true;
        }
      }
    );

    this._submitStream
      .asObservable()
      .subscribe((e: any) => {
        e.preventDefault();
        this.disabled = true;
        this._submitDisabled = true;
        this.uploadService.submit();
      });
  }

  ngAfterContentInit() {
    if (
      this.templateContainer &&
      this.templateContainer.templateChildren
    ) {
      this.templateContainer.templateChildren
        .toArray()
        .forEach((child) => {
          if (!this._templateMap.get(child.id)) {
            this._templateMap.set(child.id, child.template);
          }
        });
    }
  }

  ngOnDestroy(): void {
    this._uploadStatus$.unsubscribe();
    this._uploadSubmitComplete$.unsubscribe();
    this._submitStream.complete();
  }
}

