import { coerceBooleanProperty } from '@angular/cdk/coercion';
import {
  ChangeDetectionStrategy,
  ChangeDetectorRef,
  Component,
  Input,
  ViewEncapsulation,
} from '@angular/core';
import { isValidString } from '../combobox/utils';
import { FILEUPLOAD } from './fileupload.constants';
import { FileUploadService } from './fileupload.service';

@Component({
  selector: 'vds-fileupload-dropzone',
  templateUrl: './fileupload-dropzone.component.html',
  changeDetection: ChangeDetectionStrategy.OnPush,
  encapsulation: ViewEncapsulation.None,
})
export class FileUploadDropzoneComponent {
  /**
   * If true, dropzone is disabled <br>
   * Default: <code>false</code>
   */
  @Input()
  get disabled(): boolean {
    return this._disabled;
  }
  set disabled(value) {
    this._disabled = coerceBooleanProperty(value);
  }
  private _disabled = false;

  /**
   * If true, upload will begin immediately <br>
   * Default: <code>false</code>
   */
  @Input()
  get autoSubmit(): boolean {
    return this._autoSubmit;
  }
  set autoSubmit(value) {
    this._autoSubmit = coerceBooleanProperty(value);
  }
  private _autoSubmit = false;

  /**
   * Label for dropzone <br>
   * Default: <code>'Drag and drop files or'</code>
   */
  @Input()
  get label(): string | null {
    return this._label;
  }
  set label(value) {
    if (isValidString(value)) {
      this._label = value;
    }
  }
  private _label = FILEUPLOAD.DROPZONE_LABEL;

  _dragOver = false;

  constructor(
    private cdRef: ChangeDetectorRef,
    public uploadService: FileUploadService
  ) {}

  handleDrop(e: DragEvent) {
    e.preventDefault();

    if (!this.disabled) {
      this._dragOver = false;
      this.cdRef.detectChanges();

      this.uploadService.add(
        e.dataTransfer.files,
        this.autoSubmit
      );
    }
  }

  handleDragOver(e) {
    e.preventDefault();

    if (!this.disabled) {
      this._dragOver = true;
      this.cdRef.detectChanges();
    }
  }

  handleDragLeave(e) {
    e.preventDefault();

    if (!this.disabled) {
      this._dragOver = false;
      this.cdRef.detectChanges();
    }
  }
}

