   * Label for input element <br>
   * Default: <code>'Choose File'</code>
   */
  @Input()
  get label(): string | null {
    return this._label;
  }
  set label(value) {
    if (isValidString(value)) {
      this._label = value;
    }
  }
  private _label = FILEUPLOAD.INPUT_LABEL;

  _hasFocus = false;

  constructor(
    private vdsLibService: VdsLibService,
    private cdRef: ChangeDetectorRef,
    public uploadService: FileUploadService
  ) {}

  ngOnInit() {
    if (!isValidString(this.id)) {
      this.id = `vds-fileupload-input-${this.vdsLibService.getUUID()}`;
    }
  }

  handleChange(e) {
    if (!this.disabled) {
      this.uploadService.add(
        e.target.files,
        this.autoSubmit
      );
      e.target.value = null;
    }
  }

  handleFocus() {
    if (!this.disabled) {
      this._hasFocus = true;
      this.cdRef.detectChanges();
    }
  }

  handleBlur() {
    if (!this.disabled) {
      this._hasFocus = false;
      this.cdRef.detectChanges();
    }
  }
}

