import { Component, Input, OnInit } from '@angular/core';
import { VdsLibService } from '../vds-lib.service';
import { IconLibraryComponent } from '../icon-library/icon-library.component';
import { ICON } from './icon.constant';

@Component({
  selector: 'vds-icon',
  templateUrl: './icon.component.html',
})
export class IconComponent implements OnInit {
  /**
   * Alternative text to provide information for screen readers.
   * <code>#a11y</code>
   */
  @Input() altText = '';
  /**
   * Icon value to be used. Defaults to high resolution icons.
   */
  @Input() icon = '';
  /**
   * Set to true for low resolution icons.
   */
  @Input() low = false;
  /**
   * Informs screenreaders that this icon is
   * visual only.
   */
  @Input() presentation: boolean;
  /**
   * Set to true for tiny resolution icons.
   */
  @Input() tiny = false;

  constructor(private vdsLibService: VdsLibService) {}

  ngOnInit() {
    this.vdsLibService.insertGlobalComponent(
      IconLibraryComponent,
      'vds-icon-library'
    );

    this.presentation = this.vdsLibService.triageDisabledValue(
      this.presentation
    );
  }

  getIconReference(icon: string): string {
    if (icon) {
      if (this.tiny) {
        return `#${icon
          .replace(ICON.PREFIX.VISA, '')
          .replace(/_/g, '-')}${ICON.SUFFIX.TINY}`;
      }
      if (this.low) {
        return `#${icon
          .replace(ICON.PREFIX.VISA, '')
          .replace(/_/g, '-')}${ICON.SUFFIX.LOW}`;
      }
      return `#${icon
        .replace(ICON.PREFIX.VISA, '')
        .replace(/_/g, '-')}${ICON.SUFFIX.HIGH}`;
    }
  }
}

