      ? value.toString()
      : null;
  }
  _labelId = null;

  @Input()
  get ariaOwns() {
    return this._ariaOwns;
  }
  set ariaOwns(value) {
    this._ariaOwns = isValidString(value)
      ? value.toString()
      : null;
  }
  _ariaOwns = null;

  @Input()
  get ariaActiveDescendant() {
    return this._ariaActiveDescendant;
  }
  set ariaActiveDescendant(value) {
    this._ariaActiveDescendant = isValidString(value)
      ? value.toString()
      : null;
  }
  _ariaActiveDescendant = null;

  @Input()
  get ariaAutocomplete() {
    return this._ariaAutocomplete;
  }
  set ariaAutocomplete(value) {
    this._ariaAutocomplete = isValidString(value)
      ? value.toString()
      : null;
  }
  _ariaAutocomplete = 'list';

  @Input()
  get debounceTime() {
    return this._debounceTime;
  }
  set debounceTime(value) {
    this._debounceTime = coerceNumberProperty(value, 0);
  }
  _debounceTime = 0;

  @Input()
  get value() {
    return this._value;
  }
  set value(value) {
    this._value = isValueValid(value)
      ? value.toString()
      : '';
  }
  _value = '';

  @Input()
  get isExpanded() {
    return this._isExpanded;
  }
  set isExpanded(value) {
    this._isExpanded = coerceBooleanProperty(value);
  }
  _isExpanded = false;

  @Input()
  get label() {
    return this._label;
  }
  set label(value) {
    this._label = isValidString(value)
      ? value.toString()
      : '';
  }
  _label = '';

  @Input()
  get error() {
    return this._error;
  }
  set error(value) {
    this._error = isValidString(value)
      ? value.toString()
      : '';
  }
  _error = '';

  @Output()
  buttonSelectEvent = new EventEmitter();

  @Output()
  inputKeydownEvent = new EventEmitter();

  @Output()
  inputKeyupEvent = new EventEmitter();

  constructor() {
    this._inputChangeStream
      .asObservable()
      .pipe(
        debounceTime(Math.max(0, this.debounceTime)),
        distinctUntilChanged()
      )
      .subscribe((event: any) => {
        this.value = event.target.value;
        this.inputKeyupEvent.emit(event);
      });
  }

  ngOnDestroy() {
    this._inputChangeStream.complete();
  }

  handleButtonSelect(event) {
    this.inputElement.nativeElement.focus();
    this.buttonSelectEvent.emit(event);
  }

  handleFocus() {
    this._hasFocus = true;
  }

  handleBlur() {
    this._hasFocus = false;
  }
}

