import { Component, OnInit, Input } from '@angular/core';
import {
  UNIT_DEFAULT,
  LABEL_DEFAULT,
} from './linear-progress.constants';

@Component({
  selector: 'vds-linear-progress',
  templateUrl: './linear-progress.component.html',
})
export class LinearProgressComponent implements OnInit {
  /**
   * Sets the type of progress bar.
   */
  @Input() determinate = false;
  /**
   * The number corresponding to the quantity
   * of processed data in a *determinate* progress bar.
   */
  @Input() loaded = 0;
  /**
   * The number to which percentages are expressed.
   * Set to '0' by default
   */
  @Input() mantissa = 0;
  /**
   * Sets the border radius style.
   */
  @Input() rounded = false;
  /**
   * The number corresponding to the total quantity
   * of expected data in a *determinate* progress bar.
   */
  @Input() total = 0;
  /**
   * The data units in a *determinate* progress bar.
   */
  @Input() units: string = UNIT_DEFAULT;

  label: string;
  percentage: string;

  constructor() {}

  ngOnInit() {
    this.total = this.total > 0 ? this.total : 0;
    if (this.loaded > this.total) {
      this.loaded = this.total;
    }
    if (this.loaded < 0) {
      this.loaded = 0;
    }
    this.percentage = this.calculatePercentage();
    if (this.determinate) {
      this.label = `${LABEL_DEFAULT.FIRST_CLAUSE}, ${
        this.percentage
      } ${LABEL_DEFAULT.SECOND_CLAUSE}`;
    } else {
      this.label = LABEL_DEFAULT.FIRST_CLAUSE;
    }
  }

  calculatePercentage(): string {
    let num: string;
    if (this.loaded === 0 || this.total === 0) {
      num = '0';
    } else {
      num = `${((this.loaded / this.total) * 100).toFixed(
        this.mantissa
      )}`;
    }
    num = parseInt(num, 10) > 100 ? '100' : num;
    return `${num}%`;
  }
}

import { Component, Input, OnInit } from '@angular/core';
import { VdsLibService } from '../vds-lib.service';
import { LINK } from './link.constants';
import { RADIO } from '../radio/radio.constant';
import { Router } from '@angular/router';

@Component({
  selector: 'vds-link',
  templateUrl: './link.component.html',
})
export class LinkComponent implements OnInit {
  /**
   * Disable statically or programmatically.
   * Use as attribute or input property.
   * Default: <code>false</code>
   */
  @Input() disabled: boolean;
  /**
   * Hyperlink URL or URL fragment.
   */
  @Input() href: string;
  /**
   * The id of the element.
   */
  @Input() id: string;
  /**
   * The name of the element.
   */
  @Input() name: string;
  /**
   * ARIA label for accessibility.
   */
  @Input() ariaLabel: string;
  /**
   * Set external to open the link in new tab.
   * Adds icon to represent that the link will be opened in new tab.
   */
  @Input() external: boolean;
  /**
   * Icon for external link. Default = <code>maximize</code>
   */
  @Input() externalIcon = LINK.ICON.EXTERNAL;
  /**
   * Set inline for usage in middle of text.
   */
  @Input() inline: boolean;
  /**
   * Route within the app.
   */
  @Input() route: boolean;

  linkID: string;
  linkName: string;

  constructor(
    private vdsLibService: VdsLibService,
    private router: Router
  ) {}

  ngOnInit() {
    this.disabled = this.vdsLibService.triageDisabledValue(
      this.disabled
    );
    this.href = this.href ? this.href : '';
    this.ariaLabel = this.ariaLabel ? this.ariaLabel : '';
    this.id = this.id
      ? this.id
      : this.vdsLibService.getUUID(LINK.PREFIX.ID);
    this.name = this.name
      ? this.name
      : this.id + RADIO.SUFFIX.NAME;
    this.linkID = `${this.id}${LINK.SUFFIX.NATIVE}`;
    this.linkName = `${this.name}${LINK.SUFFIX.NATIVE}`;
    this.inline = this.vdsLibService.triageDisabledValue(
      this.inline
    );
    this.route = this.vdsLibService.triageDisabledValue(
      this.route
    );
    this.external = this.vdsLibService.triageDisabledValue(
      this.external
    );
  }

  navigateToLink(event: Event) {
    event.preventDefault();
    let newWindow: Window;

    if (this.route) {
      this.router.navigate([this.href]);
      return;
    }

    newWindow = this.external
      ? window.open(this.href, '_blank')
      : window.open(this.href, '_self');
    newWindow.opener = null;
  }
}

