import {
  Component,
  EventEmitter,
  Input,
  OnInit,
  Output,
} from '@angular/core';
import { VdsLibService } from '../vds-lib.service';
import { LISTBOX } from './listbox.constant';

@Component({
  selector: 'vds-listbox',
  templateUrl: './listbox.component.html',
})
export class ListboxComponent implements OnInit {
  /**
   * The id of the listbox element.
   */
  @Input() id: string;
  /**
   * Used to indicate listbox multi-select.
   */
  @Input() isMultiselect: boolean;
  /**
   * The list of items.
   * <code>
   *   [{ label: string, value: string }]
   * </code>
   */
  @Input() items: Array<any>;
  /**
   * The user display label of the listbox. Not for use within vds-menu.
   */
  @Input() label: string;
  /**
   * The name of the listbox element.
   */
  @Input() name: string;
  /**
   * The selected items in the listbox.
   */
  @Input() selectedItems: Array<any>;
  /**
   * Emits selected items.
   */
  @Output() change: EventEmitter<any> = new EventEmitter();

  public currentIndex: number;
  public listboxID: string;
  public listboxName: string;
  public listboxLabel: string;
  public listboxList: string;
  public listboxListItem: string;
  public activeDescendent: string;
  public value: string;

  constructor(private vdsLibService: VdsLibService) {}

  ngOnInit() {
    this.id = this.id
      ? this.id
      : this.vdsLibService.getUUID(LISTBOX.PREFIX.ID);
    this.name = this.name
      ? this.name
      : this.id + LISTBOX.SUFFIX.NAME;
    this.listboxID = `${this.id}${LISTBOX.SUFFIX.NATIVE}`;
    this.listboxName = `${this.name}${
      LISTBOX.SUFFIX.NATIVE
    }`;
    this.listboxLabel = `${this.id}${LISTBOX.SUFFIX.LABEL}`;
    this.listboxList = `${this.id}${LISTBOX.SUFFIX.LIST}`;
    this.listboxListItem = `${this.id}${
      LISTBOX.SUFFIX.LIST_ITEM
    }`;
    this.isMultiselect = this.vdsLibService.triageDisabledValue(
      this.isMultiselect
    );
    this.checkForPreSelectedItems();
  }

  stopEvents(event) {
    event.stopPropagation();
    event.preventDefault();
  }

  select(event) {
    this.stopEvents(event);
    const el: Element = event.target as Element;
    let theIndex: string = el.getAttribute(
      LISTBOX.ATTRIBUTES.DATA_INDEX
    );
    if (
      el
        .getAttribute(LISTBOX.ATTRIBUTES.CLASS)
        .indexOf(LISTBOX.ATTRIBUTES.CHECKBOX) !== -1
    ) {
      theIndex = el
        .getAttribute(LISTBOX.ATTRIBUTES.FOR)
        .split(
          LISTBOX.ATTRIBUTES.CHECKBOX +
            LISTBOX.SYMBOLS.HYPHEN
        )[1]
        .split(LISTBOX.SYMBOLS.HYPHEN)[0];
    }
    this.currentIndex = parseInt(theIndex, 10);
    if (this.isMultiselect) {
      this.changeMultiSelectStatusQuo();
      return;
    }
    this.changeStatusQuo();
  }

  goingUp(event: Event) {
    this.stopEvents(event);
    if (this.currentIndex === 0) {
      return;
    }
    this.currentIndex -= 1;
    if (this.isMultiselect) {
      return;
    }
    this.changeStatusQuo();
  }

  comingDown(event: Event) {
    this.stopEvents(event);
    if (this.currentIndex === this.items.length - 1) {
      return;
    }
    this.currentIndex += 1;
    if (this.isMultiselect) {
      return;
    }
    this.changeStatusQuo();
  }

  selectMultiSelectItem(event: Event) {
    this.stopEvents(event);
    if (this.isMultiselect) {
      this.changeMultiSelectStatusQuo();
    }
  }

  changeStatusQuo() {
    this.value = this.items[this.currentIndex].value;
    this.activeDescendent =
      this.listboxListItem +
      LISTBOX.SYMBOLS.HYPHEN +
      this.currentIndex;
    this.selectedItems = [
      {
        label: this.items[this.currentIndex].label,
        value: this.value,
      },
    ];
    this.change.next(this.selectedItems);
  }

  checkForPreSelectedItems() {
    if (this.selectedItems && this.selectedItems.length) {
      this.activeDescendent =
        this.listboxListItem +
        LISTBOX.SYMBOLS.HYPHEN +
        this.findSingleSelectionPosition();

      if (!this.isMultiselect) {
        this.value = this.selectedItems[0].value;
        this.change.next(this.selectedItems);
        return;
      }

      const multiSelectInputItems = {};
      let newValue = '';
      this.value = '';
      this.selectedItems.map((item) => {
        multiSelectInputItems[item.value] = true;
      });
      this.items.map((item) => {
        if (multiSelectInputItems[item.value]) {
          item.checked = true;
          newValue += item.value + LISTBOX.SYMBOLS.COMMA;
        }
      });
      this.value = newValue;
      this.change.next(this.selectedItems);
    }
  }

  findSingleSelectionPosition(): number {
    const that = this;
    let foundIndex = -1;
    this.items.forEach((item, index) => {
      if (that.selectedItems[0].value === item.value) {
        foundIndex = index;
      }
    });
    return foundIndex;
  }

  changeMultiSelectStatusQuo() {
    const that = this;
    let newValue = '';
    this.value = '';
    this.selectedItems = [];
    this.activeDescendent =
      this.listboxListItem +
      LISTBOX.SYMBOLS.HYPHEN +
      this.currentIndex;
    this.items[this.currentIndex].checked = this.items[
      this.currentIndex
    ].checked
      ? !this.items[this.currentIndex].checked
      : true;
    this.items.map((item) => {
      if (item.checked) {
        that.selectedItems.push({
          label: item.label,
          value: item.value,
        });
        newValue += item.value + LISTBOX.SYMBOLS.COMMA;
      }
    });
    this.value = newValue;
    this.change.next(this.selectedItems);
  }
}

