import {
  Component,
  OnInit,
  Input,
  ContentChild,
  forwardRef,
  ContentChildren,
  QueryList,
  AfterContentInit,
} from '@angular/core';
import {
  NAV_DEFAULT,
  NavColorScheme,
  NavPosition,
} from './nav.constants';
import { VdsLibService } from '../vds-lib.service';
import { ButtonComponent } from '../button/button.component';
import { ParentNav } from '../vds-lib.service.constants';
import { NavlinkComponent } from '../navlink/navlink.component';
import { Router } from '@angular/router';
import { NavmenuComponent } from '../navmenu/navmenu.component';

@Component({
  selector: 'vds-nav',
  templateUrl: './nav.component.html',
  styleUrls: ['./nav.component.scss'],
  providers: [
    {
      provide: ParentNav,
      useExisting: forwardRef(() => NavComponent),
    },
  ],
})
export class NavComponent
  implements OnInit, AfterContentInit {
  @ContentChild(ButtonComponent) rightButton;
  /**
   * Sets the horizontal nav content to take up the full width of the viewport.
   */
  @Input() horizontalFullWidth: boolean;
  /**
   * Sets the logo icon. Defaults to Visa logo.
   */
  @Input() src: string;
  /**
   * Sets the logo icon's fallback/aria text.
   * Defaults to 'Visa icon'.
   */
  @Input() alt: string = NAV_DEFAULT.altText;
  /**
   * The path that the nav goes to when the user
   * clicks the logo icon.
   */
  @Input() href: string;
  /**
   * Sets the color scheme by application type.
   */
  @Input() colorScheme: NavColorScheme =
    NavColorScheme.DEFAULT;
  /**
   * Sets the nav positioning.
   * Options are 'fixed', 'absolute' or 'relative'
   * (defaults to fixed).
   */
  @Input() position: NavPosition;
  /**
   * Sets the text for a11y skip label.
   * Defaults to 'Skip to main content'.
   */
  @Input() skipLabel: string = NAV_DEFAULT.skipLabel;
  /**
   * Navigation for skip a11y tabbing. Defaults to empty string.
   */
  @Input() skipPath: string = NAV_DEFAULT.skipPath;

  /**
   * Name of the application
   */
  @Input() appName: string;

  @ContentChildren(NavlinkComponent) links: QueryList<
    NavlinkComponent
  >;

  @ContentChildren(NavmenuComponent)
  menu: QueryList<NavmenuComponent>;

  isMobile: boolean;
  isRouting: boolean;
  name = NAV_DEFAULT.name;
  currentIcon = NAV_DEFAULT.menu;
  NavColorScheme = NavColorScheme;
  Position = NavPosition;
  NAV_DEFAULT = NAV_DEFAULT;
  currentURL: string;
  prevLink: NavlinkComponent;
  currentlySelected: NavlinkComponent;
  justLoaded = true;
  allLinks = {};

  constructor(
    public vdsLibService: VdsLibService,
    private route: Router
  ) {
    const hasHref = this.vdsLibService.triageDisabledValue(
      this.href
    );
    this.href = hasHref ? this.href : '';
  }

  private setPosition() {
    const enumValues = this.vdsLibService.getEnumValues(
      NavPosition
    );
    if (
      !this.position ||
      !enumValues.includes(this.position.toUpperCase())
    ) {
      this.position = NavPosition.FIXED;
    }
  }

  private setColorScheme() {
    const enumValues = this.vdsLibService.getEnumValues(
      this.NavColorScheme
    );
    if (
      !enumValues.includes(this.colorScheme.toUpperCase())
    ) {
      this.colorScheme = this.NavColorScheme.DEFAULT;
    }
  }

  ngOnInit() {
    this.setPosition();
    this.horizontalFullWidth = this.vdsLibService.triageDisabledValue(
      this.horizontalFullWidth
    );
    this.skipLabel = NAV_DEFAULT.skipLabel;
    this.setColorScheme();
    this.setLogoSrc();
  }

  ngAfterContentInit() {
    if (this.menu.length > 0) {
      const _menu = this.menu.toArray()[0];
      _menu.isInNav = true;
      _menu.select.subscribe((select) => {
        if (this.prevLink) {
          this.prevLink.deselect();
          this.prevLink = null;
        }
      });
    }
    if (this.links) {
      const _links = this.links.toArray();
      _links.forEach((link) => {
        link.selectEvent.subscribe((selected) => {
          selected.component.select();
          if (this.prevLink) {
            this.prevLink.deselect();
          }
          this.prevLink = selected.component;
        });
      });
    }
    this.updateLibServiceWithNavInfo();
  }

  private updateLibServiceWithNavInfo() {
    this.vdsLibService.setNavInfo({
      orientation: 'horizontal',
    });
  }

  resetHighlighting() {
    if (this.prevLink) {
      this.prevLink.deselect();
    }
  }

  private setLogoSrc() {
    if (this.src) {
      return;
    }
    switch (this.colorScheme) {
      case this.NavColorScheme.LIGHT:
        this.src = NAV_DEFAULT.srcLight;
        break;
      case this.NavColorScheme.CONSUMER:
      case this.NavColorScheme.DEFAULT:
      case this.NavColorScheme.MARKETING:
      default:
        this.src = NAV_DEFAULT.src;
        break;
    }
  }
}

