import {
  Component,
  OnInit,
  Input,
  EventEmitter,
  Output,
  Optional,
  ElementRef,
} from '@angular/core';
import { ParentNav } from '../vds-lib.service.constants';
import {
  NAV_DEFAULT,
  NavChild,
} from '../nav/nav.constants';
import {
  NAVMENU_DEFAULT,
  NavSelect,
} from '../navmenu/navmenu.constants';
import { VdsLibService } from '../vds-lib.service';
import { Router } from '@angular/router';

@Component({
  selector: 'vds-navlink',
  templateUrl: './navlink.component.html',
})
export class NavlinkComponent extends NavChild
  implements OnInit {
  /**
   * Set external to open the link in new tab.
   */
  @Input() external: boolean;
  /**
   * Path link for external location hierarchy.
   */
  @Input() href: string;

  /**
   * Flag set for internal routing
   */
  @Input() route: boolean;
  /**
   * Emits change event.
   */
  @Output() selectEvent: EventEmitter<
    NavSelect
  > = new EventEmitter<NavSelect>();

  id: string;
  element: ElementRef;
  isSelected: boolean;
  isInNav: boolean;

  constructor(
    @Optional() public myParent: ParentNav,
    private vdsLibService: VdsLibService,
    private el: ElementRef,
    private router: Router
  ) {
    super();
    this.id = vdsLibService.getUUID();
    this.element = el.nativeElement.children;
  }

  ngOnInit() {
    this.href = this.href ? this.href : '';
    this.external = this.vdsLibService.triageDisabledValue(
      this.external
    );
    this.route = this.vdsLibService.triageDisabledValue(
      this.route
    );
  }

  inNav() {
    if (this.myParent && this.myParent.name) {
      switch (this.myParent.name) {
        case NAVMENU_DEFAULT.name:
          return false;
        case NAV_DEFAULT.name:
        default:
          return true;
      }
    }
  }

  navigateToLink(event?: Event) {
    if (event) {
      event.preventDefault();
    }
    let newWindow: Window;

    if (this.route) {
      this.navigate(this.href);
      return;
    }
    newWindow = this.external
      ? window.open(this.href, '_blank')
      : window.open(this.href, '_self');
    if (newWindow) {
      newWindow.opener = null;
    }
  }

  private navigate(href: string): boolean {
    this.router.navigate([this.href]).then(() => {
      return true;
    });
    return false;
  }

  select() {
    this.isSelected = true;
  }

  deselect() {
    this.isSelected = false;
  }

  open() {}
  close() {}

  emitEvent() {
    this.selectEvent.next({
      href: this.href,
      isNested: this.myParent.name === 'disclosure',
      parent: this.myParent,
      role: 'link',
      component: this,
    });
  }
}

import {
  Component,
  OnInit,
  ContentChildren,
  AfterContentInit,
  ContentChild,
  forwardRef,
  EventEmitter,
  Output,
} from '@angular/core';
import { IconComponent } from '../icon/icon.component';
import {
  MENU_TYPES,
  NAVMENU_DEFAULT,
  NavSelect,
} from './navmenu.constants';
import { NavmenuImageComponent } from './navmenu-image/navmenu-image.component';
import { NAV_DEFAULT } from '../nav/nav.constants';
import { NavbuttonComponent } from './navbutton/navbutton.component';
import { ParentNav } from '../vds-lib.service.constants';
import { NavlinkComponent } from '../navlink/navlink.component';
import { NavmenuTitleComponent } from './navmenu-title/navmenu-title.component';
import { NavmenuInitialsComponent } from './navmenu-initials/navmenu-initials.component';

@Component({
  selector: 'vds-navmenu',
  templateUrl: './navmenu.component.html',
  styleUrls: ['./navmenu.component.css'], // Uses same class overwrite as dropdown
  providers: [
    {
      provide: ParentNav,
      useExisting: forwardRef(() => NavmenuComponent),
    },
  ],
})
export class NavmenuComponent
  implements OnInit, AfterContentInit {
  @ContentChildren(NavlinkComponent) navLinks = [];
  @ContentChild(NavmenuTitleComponent) title;
  @ContentChild(NavmenuInitialsComponent) initials;
  @ContentChild(IconComponent) icon;
  @ContentChild(NavmenuImageComponent) image;
  @ContentChild(NavbuttonComponent) navButton;

  @Output() select: EventEmitter<
    NavSelect
  > = new EventEmitter<NavSelect>();

  menuType: string;
  dropdownIcon: string = NAV_DEFAULT.down;
  isSelected: boolean;
  hasLinks = false;
  show = false;
  textContent = '';
  name = NAVMENU_DEFAULT.name;
  isInNav: boolean;

  constructor() {}

  ngOnInit() {}

  ngAfterContentInit() {
    if (this.navLinks.length > 0) {
      this.hasLinks = true;
    }
    if (this.navButton) {
      this.navButton.activate.subscribe(() => {
        this.toggle();
      });
    }
  }

  private setIcon() {
    this.dropdownIcon =
      this.dropdownIcon === NAV_DEFAULT.down
        ? NAV_DEFAULT.up
        : NAV_DEFAULT.down;
  }

  getTitle(): string {
    if (this.hasTitle()) {
      return this.title.innerText;
    }
    return '';
  }

  getMenuType(): string {
    if (this.hasIcon()) {
      return MENU_TYPES.icon;
    }
    if (this.hasInitials()) {
      return MENU_TYPES.initials;
    }
    if (this.hasTitle()) {
      return MENU_TYPES.dropdown;
    }
  }

  isAvatar(): boolean {
    return (
      this.hasTitle() ||
      this.hasInitials() ||
      this.hasIcon() ||
      this.hasImage()
    );
  }

  hasTitle(): boolean {
    return this.title ? true : false;
  }

  hasInitials(): boolean {
    return this.initials ? true : false;
  }

  hasIcon(): boolean {
    return this.icon ? true : false;
  }

  hasImage(): boolean {
    return this.image ? true : false;
  }

  toggle() {
    this.show = !this.show;
    this.setIcon();
    this.select.next({
      component: this,
    });
  }

  hide() {
    this.show = false;
    this.setIcon();
  }
}

