  forwardRef,
  Input,
  HostBinding,
  ContentChildren,
  QueryList,
  AfterContentInit,
} from '@angular/core';
import { ParentNav } from '../vds-lib.service.constants';
import {
  NavPosition,
  NavColorScheme,
  NAV_DEFAULT,
  NavStrategy,
  NavData,
} from '../nav/nav.constants';
import { NavDisclosureComponent } from '../nav-disclosure/nav-disclosure.component';
import { NavlinkComponent } from '../navlink/navlink.component';
import { VdsLibService } from '../vds-lib.service';
import { Router, NavigationEnd } from '@angular/router';

@Component({
  selector: 'vds-nav-vertical',
  templateUrl: './nav-vertical.component.html',
  styleUrls: ['./nav-vertical.component.css'],
  providers: [
    {
      provide: ParentNav,
      useExisting: forwardRef(() => NavVerticalComponent),
    },
  ],
})
export class NavVerticalComponent
  implements OnInit, AfterContentInit {
  /**
   * Sets the logo icon's fallback/aria text.
   * Defaults to 'Visa icon'.
   */
  @Input() alt: string = NAV_DEFAULT.altText;
  /**
   * Sets the color scheme by application type.
   */
  @Input() colorScheme: NavColorScheme =
    NavColorScheme.DEFAULT;
  /**
   * The path that the nav goes to when the user
   * clicks the logo icon.
   */
  @Input() href: string;
  /**
   * Sets the nav positioning.
   * Options are 'fixed', 'absolute' or 'relative'
   * (defaults to fixed)
   */
  @Input() position: NavPosition;
  /**
   * Sets the logo icon. Defaults to Visa logo.
   */
  @Input() src: string;
  /**
   * Sets the text for a11y skip label.
   * Defaults to 'Skip to main content'.
   */
  @Input() skipLabel: string = NAV_DEFAULT.skipLabel;
  /**
   * Navigation for skip a11y tabbing. Defaults to empty string.
   */
  @Input() skipPath: string = NAV_DEFAULT.skipPath;
  /**
   * Sets nav as closed if true, open if false. <br>
   * Defaults to <code>false</code>.
   */
  @Input() verticalMini: boolean;

  @HostBinding('style.minWidth') width;

  @ContentChildren(NavlinkComponent) links: QueryList<
    NavlinkComponent
  >;
  @ContentChildren(NavDisclosureComponent)
  disclosures: QueryList<NavDisclosureComponent>;

  NavColorScheme = NavColorScheme;
  NAV_DEFAULT = NAV_DEFAULT;
  isRouting: boolean;
  prevLink: NavlinkComponent;
  currentlySelected: NavlinkComponent;
  currentURL: string;
  allLinks = {};
  justLoaded = true;
  name = 'nav';

  constructor(
    private vdsLibService: VdsLibService,
    private route: Router
  ) {}

  ngOnInit() {
    this.verticalMini = this.vdsLibService.triageDisabledValue(
      this.verticalMini
    );
    this.width = NAV_DEFAULT.openWidth;
    this.position = this.position
      ? this.position
      : NavPosition.FIXED;
    this.setLogoSrc();
  }

  ngAfterContentInit() {
    let temp = [];
    const rootLinks = this.links.toArray();
    temp = rootLinks;
    this.disclosures.forEach((disclosure) => {
      const leafLinks = disclosure.links.toArray();
      temp.push(disclosure);
      temp = temp.concat(leafLinks);
    });

    temp.forEach((link) => {
      this.allLinks[link.href] = link;
    });

    this.route.events.subscribe((change) => {
      if (
        change instanceof NavigationEnd &&
        this.justLoaded
      ) {
        this.currentURL = change.urlAfterRedirects;
        const elements = this.currentURL
          .split('/')
          .filter((val) => {
            return val.length > 0;
          });

        if (this.allLinks[this.currentURL]) {
          if (elements.length > 1) {
            this.prevLink = this.allLinks[
              `/${elements[0]}`
            ];
          }

          this.isRouting = true;
          this.allLinks[this.currentURL].emitEvent();
          this.isRouting = false;
        }
        this.justLoaded = false;
      }
    });

    temp.forEach((link) => {
      link.selectEvent.subscribe((data: NavData) => {
        const strategy = this.getStrategy(data);

        // Handles stored link actions.
        switch (strategy.store) {
          case NavStrategy.NoneStored:
            break;
          case NavStrategy.RootStored:
            if (data.component.href) {
              this.prevLink.deselect();
              this.currentlySelected.deselect();
            }
            break;
          case NavStrategy.DisclosureStored:
            if (
              data.component.href &&
              this.prevLink &&
              this.currentlySelected
            ) {
              this.prevLink.deselect();
              this.currentlySelected.deselect();
            }
            if (
              data.component.myParent !== this.prevLink &&
              data.component !== this.prevLink
            ) {
              this.prevLink.close();
            }
            break;
          case NavStrategy.SublinkStored:
            if (data.component.href) {
              this.prevLink.deselect();
              this.currentlySelected.deselect();
            }
            if (
              strategy.dimensionState ===
              NavStrategy.FromMiniState
            ) {
              (this.prevLink
                .myParent as NavDisclosureComponent).deselect();
              this.prevLink.myParent.close();
              break;
            }
            if (this.prevLink.myParent !== data.parent) {
              this.prevLink.myParent.close();
            }
            break;
          default:
            break;
        }

        // Handles incoming link actions.
        switch (strategy.incoming) {
          case NavStrategy.RootIncoming:
            if (data.component.href) {
              data.component.select();
              this.currentlySelected = data.component;
            }
            break;
          case NavStrategy.DisclosureIncoming:
            if (
              strategy.dimensionState ===
                NavStrategy.FromFullState &&
              this.prevLink instanceof NavlinkComponent &&
              data.component === this.prevLink.myParent
            ) {
              data.component.close();
              if (data.component.href) {
                data.component.select();
                this.currentlySelected = data.component;
              }
              break;
            }
            if (
              this.prevLink === data.component &&
              strategy.dimensionState ===
                NavStrategy.FromFullState
            ) {
              if (data.component.href) {
                data.component.select();
                this.currentlySelected = data.component;
              }
              if (data.component._open) {
                data.component.close();
                break;
              }
              data.component.open();
              break;
            }
            if (
              strategy.dimensionState ===
              NavStrategy.FromMiniState
            ) {
              this.verticalMini = false;
              data.component._navIsOpen = true;
              this.width = NAV_DEFAULT.openWidth;
              data.component.open();
              if (data.component.href) {
                data.component.select();
                this.currentlySelected = data.component;
              }
              break;
            }
            if (data.component.href) {
              data.component.toggle();
              if (data.component.isSelected) {
                data.component.deselect();
                break;
              }
              data.component.select();
              break;
            }
            data.component.open();
            break;
          case NavStrategy.SublinkIncoming:
            if (this.isRouting) {
              this.currentlySelected = data.component;
              this.prevLink.open();
              data.component.select();
              break;
            }
            if (data.component.href) {
              data.component.select();
              this.currentlySelected = data.component;
            }
            break;
          default:
            break;
        }
        this.prevLink = data.component;
        if (data.href && data.href.length > 0) {
          this.route.navigateByUrl(data.href);
        }
      });
    });

    this.updateLibServiceWithNavInfo();
  }

  private getStrategy(
    data: NavData
  ): {
    store: NavStrategy;
    incoming: NavStrategy;
    dimensionState: NavStrategy;
  } {
    const strategyObj = {
      store: null,
      incoming: null,
      dimensionState: null,
    };

    // None Stored
    if (!this.prevLink) {
      strategyObj.store = NavStrategy.NoneStored;
    }

    // Root Stored
    if (
      this.prevLink instanceof NavlinkComponent &&
      !(
        this.prevLink.myParent instanceof
        NavDisclosureComponent
      )
    ) {
      strategyObj.store = NavStrategy.RootStored;
    }

    // Disclosure Stored
    if (this.prevLink instanceof NavDisclosureComponent) {
      strategyObj.store = NavStrategy.DisclosureStored;
    }

    // Sublink Stored
    if (
      this.prevLink instanceof NavlinkComponent &&
      this.prevLink.myParent instanceof
        NavDisclosureComponent
    ) {
      strategyObj.store = NavStrategy.SublinkStored;
    }

    // Incoming Root
    if (
      data.component instanceof NavlinkComponent &&
      !(data.parent instanceof NavDisclosureComponent)
    ) {
      strategyObj.incoming = NavStrategy.RootIncoming;
    }

    // Incoming Disclosure
    if (data.component instanceof NavDisclosureComponent) {
      strategyObj.incoming = NavStrategy.DisclosureIncoming;
    }

    // Sublink incoming
    if (
      data.component instanceof NavlinkComponent &&
      data.parent instanceof NavDisclosureComponent
    ) {
      strategyObj.incoming = NavStrategy.SublinkIncoming;
    }

    // From mini state
    if (this.verticalMini) {
      strategyObj.dimensionState =
        NavStrategy.FromMiniState;
    }

    // From full state
    if (!this.verticalMini) {
      strategyObj.dimensionState =
        NavStrategy.FromFullState;
    }

    return strategyObj;
  }

  /**
   * Toggles the vertical Nav.
   */
  toggleOpen() {
    this.verticalMini = !this.verticalMini;
    this.updateLibServiceWithNavInfo();
    if (
      this.prevLink &&
      this.prevLink.myParent instanceof
        NavDisclosureComponent
    ) {
      this.prevLink.myParent.isSelected = this.verticalMini;
      this.prevLink.myParent._navIsOpen = !this.prevLink
        .myParent._navIsOpen;
    }
    if (this.verticalMini) {
      this.width = NAV_DEFAULT.closeWidth;
      return;
    }
    this.width = NAV_DEFAULT.openWidth;
  }

  private updateLibServiceWithNavInfo() {
    this.vdsLibService.setNavInfo({
      expanded: !this.verticalMini,
      orientation: 'vertical',
    });
  }

  get currentIcon() {
    return this.verticalMini
      ? NAV_DEFAULT.close
      : NAV_DEFAULT.menu;
  }

  private setLogoSrc() {
    if (this.src) {
      return;
    }
    switch (this.colorScheme) {
      case this.NavColorScheme.LIGHT:
        this.src = NAV_DEFAULT.srcLight;
        break;
      case this.NavColorScheme.CONSUMER:
      case this.NavColorScheme.DEFAULT:
      case this.NavColorScheme.MARKETING:
      default:
        this.src = NAV_DEFAULT.src;
        break;
    }
  }
}

import {
  ChangeDetectionStrategy,
  Component,
  EventEmitter,
  Input,
  OnInit,
  OnDestroy,
  Output,
  ViewEncapsulation,
  OnChanges,
  HostListener,
  SimpleChanges,
} from '@angular/core';
import { BehaviorSubject, Subject } from 'rxjs';
import { coerceNumberProperty } from '@angular/cdk/coercion';
import { SPACE } from '@angular/cdk/keycodes';
import {
  PageEvent,
  PAGINATION,
  sortFn,
} from './pagination.constant';
import { VdsLibService } from '../vds-lib.service';

@Component({
  selector: 'vds-pagination',
  templateUrl: './pagination.component.html',
  styleUrls: ['./pagination.component.scss'],
  changeDetection: ChangeDetectionStrategy.OnPush,
  encapsulation: ViewEncapsulation.None,
})
export class PaginationComponent
  implements OnInit, OnChanges, OnDestroy {
  /**
   * Class for container <div> wrapping Pagination component <br>
   * Default: <code>null</code>
   */
  @Input() containerClass = null;

  /**
   * Whether component is disabled <br>
   * Default: <code>false</code>
   */
  @Input() disabled = false;

  /**
   * If true, a page size dropdown will accompany the paginator <br>
   * Default: <code>false</code>
   */
  @Input() displayPageSize = false;

  /**
   * If true, a page count display will accompany the paginator <br>
   * Default: <code>false</code>
   */
  @Input() displayPageCount = false;

  /**
   * Aria label for 'first page' button <br>
   * Default: <code>'First Page'</code>
   */
  @Input() ariaFirstPage = 'First Page';

  /**
   * Aria label for 'previous page' button <br>
   * Default: <code>'Previous Page'</code>
   */
  @Input() ariaPreviousPage = 'Previous Page';

  /**
   * Aria label for 'next page' button <br>
   * Default: <code>'Next Page'</code>
   */
  @Input() ariaNextPage = 'Next Page';

  /**
   * Aria label for 'last page' button <br>
   * Default: <code>'Last Page'</code>
   */
  @Input() ariaLastPage = 'Last Page';

  /**
   * Text to accompany page size dropdown <br>
   * Default: <code>'ITEMS'</code>
   */
  @Input() pageSizeText = 'ITEMS';

  /**
   * The zero-based page index of the displayed list of items <br>
   * Default: <code>0</code>
   */
  @Input()
  get pageIndex(): number {
    return this._pageIndex;
  }
  set pageIndex(value: number) {
    const numOfPages = this.numberOfPages();
    const newValue = Math.max(
      coerceNumberProperty(value),
      0
    );

    this._pageIndex =
      numOfPages > 0
        ? Math.min(newValue, numOfPages)
        : newValue;

    this._constructPageNumbers();
  }
  _pageIndex = 0;

  /**
   * Number of items to display on a page <br>
   * Default: <code>null</code>
   */
  @Input()
  get pageSize(): number {
    return this._pageSize;
  }
  set pageSize(value: number) {
    this._pageSize = coerceNumberProperty(value);

    this._validatePageSizeAndPageSizeOptions();

    this._constructPageNumbers();
  }
  _pageSize = null;

  /**
   * The set of provided page size options to display to the user <br>
   * Default: <code>[]</code>
   */
  @Input()
  get pageSizeOptions(): number[] {
    return this._pageSizeOptions;
  }
  set pageSizeOptions(value: number[]) {
    this._pageSizeOptions = (value || [])
      .map((p) => {
        p = coerceNumberProperty(p);
        if (p > 0) {
          return p;
        }

        return null;
      })
      .filter(Boolean);

    this._validatePageSizeAndPageSizeOptions();
  }
  _pageSizeOptions: number[] = [];

  /**
   * The length of the total number of items that are being paginated <br>
   * Default: <code>0</code>
   */
  @Input()
  get length(): number {
    return this._length;
  }
  set length(value: number) {
    this._length = coerceNumberProperty(value);
    this._constructPageNumbers();
  }
  _length = 0;

  /**
   * Fires when a page index or page size has changed
   */
  @Output() paginationEvent: EventEmitter<
    PageEvent
  > = new EventEmitter<PageEvent>();

  _menuOpen = false;
  _stateChange = new Subject();
  _displayedPageNumbers = new BehaviorSubject<number[]>([]);

  stateChange$ = this._stateChange.asObservable();
  displayedPageNumbers$ = this._displayedPageNumbers.asObservable();

  @HostListener('document:click')
  clickOut() {
    if (this._menuOpen && !this.disabled) {
      this._menuOpen = false;
    }
  }

  constructor(private vdsLibService: VdsLibService) {}

  ngOnInit() {
    this.disabled = this.vdsLibService.triageDisabledValue(
      this.disabled
    );

    if (this.pageIndex > this.numberOfPages()) {
      this.pageIndex = this.numberOfPages();
    }

    this._constructPageNumbers();
  }

  ngOnChanges(changes: SimpleChanges) {
    this._emitStateChange();

    if (
      (changes.length && !changes.length.firstChange) ||
      (changes.pageSize && !changes.pageSize.firstChange)
    ) {
      this.pageIndex = 0;
    }
  }

  ngOnDestroy() {
    this._stateChange.complete();
    this._displayedPageNumbers.complete();
  }

  firstPage() {
    const previousIndex = this.pageIndex;
    this.pageIndex = 0;
    this._emitPageEvent(previousIndex);
  }

  previousPage() {
    const previousIndex = this.pageIndex;
    this.pageIndex = Math.max(0, this.pageIndex - 1);
    this._emitPageEvent(previousIndex);
  }

  lastPage() {
    const previousIndex = this.pageIndex;
    this.pageIndex = this.numberOfPages();
    this._emitPageEvent(previousIndex);
  }

  nextPage() {
    const previousIndex = this.pageIndex;
    this.pageIndex = Math.min(
      this.numberOfPages(),
      this.pageIndex + 1
    );
    this._emitPageEvent(previousIndex);
  }

  handlePageSelect(page: number) {
    const previousIndex = this.pageIndex;
    this.pageIndex = page;
    this._emitPageEvent(previousIndex);
  }

  handleDropdownSelect(event) {
    event.stopPropagation();
    this._menuOpen = !this._menuOpen;
  }

  handleListboxSelect(event) {
    const pageSize = event.target.getAttribute(
      PAGINATION.DATA_ATTR_PAGE_SIZE_ITEM
    );
    if (
      (event.type === 'keydown' && event.which === SPACE) ||
      event.type === 'click'
    ) {
      event.preventDefault();
      event.stopPropagation();
      const previousIndex = this.pageIndex;
      this._menuOpen = false;
      this.pageSize = pageSize;
      this.pageIndex = 0;
      this._emitPageEvent(previousIndex);
    }
  }

  previousButtonsDisabled() {
    return (
      this.disabled ||
      !(this.pageIndex >= 1 && this.pageSize !== 0)
    );
  }

  nextButtonsDisabled() {
    return (
      this.disabled ||
      !(
        this.pageIndex < this.numberOfPages() &&
        this.pageSize !== 0
      )
    );
  }

  numberOfPages() {
    return Math.ceil(this.length / this.pageSize) - 1;
  }

  _constructPageNumbers() {
    if (this.length === 0) {
      return this._displayedPageNumbers.next([]);
    }

    const lastPage = this.numberOfPages() + 1;
    const adjPageIndex = this.pageIndex + 1;
    const blockLimit =
      adjPageIndex <= PAGINATION.START_END_LIMIT ||
      lastPage - adjPageIndex < PAGINATION.START_END_LIMIT
        ? PAGINATION.START_END_LIMIT
        : PAGINATION.MIDDLE_LIMIT;
    const modIndex = this.pageIndex % blockLimit;
    const beginBlock = [1, null];
    const endBlock = [null, lastPage];

    if (lastPage <= PAGINATION.PAGE_LIMIT) {
      // no need to do anything fancy if `lastPage <= PAGE_LIMIT`
      this._displayedPageNumbers.next(
        Array.from({ length: lastPage }, (v, i) => i + 1)
      );
    } else if (
      blockLimit === PAGINATION.START_END_LIMIT &&
      adjPageIndex > blockLimit
    ) {
      // when we are at tail end of pagination we simply use the last 7 page numbers
      this._displayedPageNumbers.next(
        beginBlock.concat(
          Array.from(
            { length: PAGINATION.START_END_LIMIT },
            (v, i) => lastPage - i
          ).sort(sortFn)
        )
      );
    } else {
      const leftBlock = Array.from(
        { length: modIndex },
        (v, i) => this.pageIndex - i
      ).sort(sortFn);
      const rightBlock =
        blockLimit >= this.pageIndex
          ? Array.from(
              { length: blockLimit - this.pageIndex },
              (v, i) => blockLimit - i
            ).sort(sortFn)
          : Array.from(
              { length: blockLimit - modIndex },
              (v, i) => adjPageIndex + i
            );

      this._displayedPageNumbers.next(
        blockLimit === PAGINATION.START_END_LIMIT
          ? leftBlock.concat(rightBlock).concat(endBlock)
          : beginBlock
              .concat(leftBlock.concat(rightBlock))
              .concat(endBlock)
      );
    }

    this._getPageCountText();
  }

  _getPageCountText() {
    const leftMarker = this.pageSize * this.pageIndex + 1;
    const rightMarker =
      this.pageIndex !== this.numberOfPages()
        ? this.pageSize * (this.pageIndex + 1)
        : this.length;

    return `${leftMarker} - ${rightMarker} of ${
      this.length
    }`;
  }

  _validatePageSizeAndPageSizeOptions() {
    if (!this._pageSize) {
      this._pageSize =
        this._pageSizeOptions.length > 0
          ? this._pageSizeOptions[0]
          : PAGINATION.DEFAULT_PAGESIZE;
    }

    if (!this._pageSizeOptions.includes(this._pageSize)) {
      let pageSizeOptions = this._pageSizeOptions.slice();
      pageSizeOptions.push(this._pageSize);
      pageSizeOptions = pageSizeOptions.sort(sortFn);
      this._pageSizeOptions = pageSizeOptions;
    }
  }

  _emitPageEvent(previousPageIndex: number = null) {
    this._emitStateChange();

    this.paginationEvent.emit({
      previousPageIndex,
      pageIndex: this.pageIndex,
      pageSize: this.pageSize,
      length: this.length,
    });
  }

  _emitStateChange() {
    this._stateChange.next({
      pageIndex: this.pageIndex,
      pageSize: this.pageSize,
      length: this.length,
    });
  }
}

import {
  Component,
  ContentChild,
  OnInit,
  AfterContentInit,
  Input,
} from '@angular/core';
import { DresserComponent } from './dresser/dresser.component';
import { VdsLibService } from '../vds-lib.service';
import { coerceBooleanProperty } from '@angular/cdk/coercion';

@Component({
  selector: 'vds-panel',
  templateUrl: './panel.component.html',
})
export class PanelComponent
  implements AfterContentInit, OnInit {
  @ContentChild(DresserComponent) dresser: DresserComponent;
  /**
   * Flag that sets the panel to animate on open and close.
   */
  @Input() animated: boolean;

  /**
   * Opens the panel on load if set to true
   */
  @Input()
  get isOpen(): boolean {
    return this._isOpen;
  }
  set isOpen(value) {
    this._isOpen = coerceBooleanProperty(value);
  }
  private _isOpen = false;

  constructor(private vdsLibService: VdsLibService) {}

  ngOnInit() {
    this.animated = this.vdsLibService.triageDisabledValue(
      this.animated
    );
  }

  ngAfterContentInit() {
    if (this.dresser) {
      this.dresser.open.subscribe((_) => {
        this.open();
      });
      this.dresser.close.subscribe((_) => {
        this.close();
      });
    }
  }

  open() {
    this.isOpen = true;
  }

  close() {
    this.isOpen = false;
  }
}

import { Component, OnInit, Input } from '@angular/core';
import {
  PROGRESS_GAUGE,
  ProgressGaugeStatus,
  Circle,
} from './progress-gauge.constants';
import { VdsLibService } from '../vds-lib.service';

@Component({
  selector: 'vds-progress-gauge',
  templateUrl: './progress-gauge.component.html',
})
export class ProgressGaugeComponent implements OnInit {
  /**
   * Descriptive text. Color dependent on status.
   */
  @Input() details: string = PROGRESS_GAUGE.DEFAULT.DETAILS;
  /**
   * Flag that sets component to smaller version.
   */
  @Input() small: boolean;
  /**
   * Sets state of component.
   * Defaults to <code>default</code>.
   */
  @Input() status: ProgressGaugeStatus =
    ProgressGaugeStatus.DEFAULT;
  /**
   * Subtitle text.
   */
  @Input() subtitle: string =
    PROGRESS_GAUGE.DEFAULT.SUBTITLE;
  /**
   * Title text.
   */
  @Input() title: string = PROGRESS_GAUGE.DEFAULT.TITLE;

  progressData = PROGRESS_GAUGE;
  // todo fix this. there needs to be a default
  circleData: Circle;
  statusArr = Object.values(ProgressGaugeStatus);

  constructor(private vdsLibService: VdsLibService) {}

  /**
   * Used in template to simplify logic
   */
  isProgress(): boolean {
    return this.status === ProgressGaugeStatus.PROGRESS;
  }

  ngOnInit() {
    this.setStatus(this.status.toLowerCase());
    this.small = this.vdsLibService.triageDisabledValue(
      this.small
    );
    if (this.small) {
      this.circleData =
        PROGRESS_GAUGE.DEFAULT.CIRCLE_REF.SMALL;
      return;
    }
    this.circleData =
      PROGRESS_GAUGE.DEFAULT.CIRCLE_REF.LARGE;
  }

  /**
   * Sets current status
   */
  private setStatus(status: string) {
    switch (status) {
      case ProgressGaugeStatus.DEFAULT:
      case ProgressGaugeStatus.PROGRESS:
      case ProgressGaugeStatus.COMPLETED:
      case ProgressGaugeStatus.APPROVED:
        this.status = status;
        break;
      default:
        console.warn(
          '[!] VDS: invalid status set in Progress-Gauge'
        );
        this.status = ProgressGaugeStatus.DEFAULT;
        break;
    }
  }
}

import {
  ChangeDetectionStrategy,
  ChangeDetectorRef,
  Component,
  EventEmitter,
  Input,
  OnInit,
  Output,
