  providers: [MakeProvider(RadioComponent)],
  changeDetection: ChangeDetectionStrategy.OnPush,
})
export class RadioComponent extends AbstractValueAccessor
  implements OnInit {
  /**
   * Checks the radio statically or programmatically. <br>
   * Use as attribute or input property. <br>
   * Default: <code>false</code>
   */
  @Input() checked: boolean;
  /**
   * Disable radio statically or programmatically. <br>
   * Use as attribute or input property. <br>
   * Default: <code>false</code>
   */
  @Input() disabled: boolean;
  /**
   * The id of the input element.
   */
  @Input() id: string;
  /**
   * Set invalid statically or programmatically. <br>
   * Use as attribute or input property. <br>
   * Default: <code>false</code>
   */
  @Input() invalid: boolean;
  /**
   * The user display label of the radio.
   */
  @Input() label: string;
  /**
   * The name of the input element.
   */
  @Input() name: string;
  /**
   * The value of the input element.
   */
  @Input() value: string | number;
  /**
   * Emits changed value.
   */
  @Output() change = new EventEmitter<any>();

  public focused = false;
  public radioID: string;
  public radioName: string;
  public radioValue: string | number;

  RADIO = RADIO;

  constructor(
    private cdRef: ChangeDetectorRef,
    private vdsLibService: VdsLibService
  ) {
    super();
  }

  ngOnInit() {
    this.id = this.id
      ? this.id
      : this.vdsLibService.getUUID(RADIO.PREFIX.ID);
    this.name = this.name
      ? this.name
      : this.id + RADIO.SUFFIX.NAME;
    this.radioID = `${this.id}${RADIO.SUFFIX.NATIVE}`;
    this.radioName = `${this.name}${RADIO.SUFFIX.NATIVE}`;
    this.checked = this.vdsLibService.triageDisabledValue(
      this.checked
    );
    this.disabled = this.vdsLibService.triageDisabledValue(
      this.disabled
    );
    this.invalid = this.vdsLibService.triageDisabledValue(
      this.invalid
    );
    this.radioValue = this.value;
  }

  writeValue(value: any) {
    super.writeValue(value);
    this.checked = value;
    this.cdRef.detectChanges();
    this.change.emit(this.checked);
  }

  checkAndWrite(): void {
    if (this.disabled) {
      return;
    }
    this.writeValue(!this.checked);
  }

  click(event: MouseEvent): void {
    this.checkAndWrite();
    event.stopPropagation();
  }

  onKeyDown(event: KeyboardEvent): void {
    this.checkAndWrite();
    event.stopPropagation();
    event.preventDefault();
  }

  onFocus(): void {
    this.focused = true;
  }

  onBlur(): void {
    this.focused = false;
  }
}

