   * The name of the radio group.
   */
  @Input() name: string;
  /**
   * The value of the radio group.
   */
  @Input() value: string | number;
  /**
   * Emits changed value.
   */
  @Output() change = new EventEmitter<any>();

  public radioID: string;
  public radioName: string;
  public radioItems: Array<RadioComponent>;

  constructor(
    private cdRef: ChangeDetectorRef,
    private vdsLibService: VdsLibService
  ) {
    super();
  }

  ngOnInit() {
    this.id = this.id
      ? this.id
      : this.vdsLibService.getUUID(RADIO.PREFIX.ID);
    this.name = this.name
      ? this.name
      : this.id + RADIO.SUFFIX.NAME;
    this.radioID = `${this.id}${RADIO.SUFFIX.NATIVE}`;
    this.radioName = `${this.name}${RADIO.SUFFIX.NATIVE}`;
    this.required = this.vdsLibService.triageDisabledValue(
      this.required
    );
    this.disabled = this.vdsLibService.triageDisabledValue(
      this.disabled
    );
  }

  ngAfterContentChecked() {
    this.runContentUpdates();
  }

  // todo not sure we need to do this
  ngAfterContentInit() {
    this.runContentUpdates();
  }

