} from '@angular/core';
import { SEARCH, SearchVariant } from './search.constants';
import { AbstractValueAccessor } from '../abstract-value-accessor';
import { VdsLibService } from '../vds-lib.service';
import {
  coerceBooleanProperty,
  coerceNumberProperty,
} from '@angular/cdk/coercion';

@Component({
  selector: 'vds-search',
  templateUrl: './search.component.html',
})
export class SearchComponent extends AbstractValueAccessor
  implements OnInit {
  @ViewChild('searchExpandableEl')
  searchExpandableEl: ElementRef;

  /**
   * Set minimum length for search assist menu.
   */
  @Input()
  get assistLength(): number {
    return this._assistLength;
  }
  set assistLength(value) {
    this._assistLength = coerceNumberProperty(value);
  }
  private _assistLength: number;

  /**
   * Search assist menu list items.
   */
  @Input()
  get assistList(): Array<string> {
    return this._assistList;
  }
  set assistList(value) {
    this._assistList = value;
  }
  private _assistList: Array<string>;

  /**
   * Clear assist list on blur of search text field.<br>
   * Applies to SearchVariant enums DYNAMIC and CONTEXTUAL.<br>
   * Defaults to <code>true</code>.
   */
  @Input()
  get clearOnBlur(): boolean {
    return this._clearOnBlur;
  }
  set clearOnBlur(value) {
    this._clearOnBlur = coerceBooleanProperty(value);
  }
  private _clearOnBlur = true;

  /**
   * The id of the search input element.
   */
  @Input()
  get id(): string {
    return this._id;
  }
  set id(value) {
    this._id = value;
  }
  private _id: string;

  /**
   * The name for the search input element.
   */
  @Input()
  get name(): string {
    return this._name;
  }
  set name(value) {
    this._name = value;
  }
  private _name: string;

  /**
   * Placeholder string for the search term.
   */
  @Input()
  get placeholder(): string {
    return this._placeholder;
  }
  set placeholder(value) {
    this._placeholder = value;
  }
  private _placeholder: string;

  /**
   * Variant specification for the type of search.
   */
  @Input()
  get variant(): SearchVariant {
    return this._variant;
  }
  set variant(value) {
    this._variant = value;
  }
  private _variant: SearchVariant = SearchVariant.STANDARD;

  /**
   * Emits selection from assist menu.
   */
  @Output() assistSelection = new EventEmitter<any>();

  /**
   * Emits search event with keyword value.
   */
  @Output() search = new EventEmitter<any>();

  /**
   * Emits value on key press.
   */
  @Output() keyup = new EventEmitter<KeyboardEvent>();

  blurHappened: boolean;
  clearAssistMenuListing: boolean;
  expanded: boolean;
  focused: boolean;
  inputId: string;
  SearchVariantType = SearchVariant;
  showClear: boolean;

  constructor(
    private vdsLibService: VdsLibService,
    private cdRef: ChangeDetectorRef
  ) {
    super();
  }

  ngOnInit() {
    this.id = this.id
      ? this.id
      : this.vdsLibService.getUUID(SEARCH.PREFIX.ID);
    this.name = this.name
      ? this.name
      : this.id + SEARCH.SUFFIX.NAME;
    this.inputId = `${this.id}${SEARCH.SUFFIX.NATIVE}`;
  }

  searchTriggered(el) {
    // this.search.emit({
    //   keyword: el.value,
    // });
    this.writeValue(el.value);
  }

  searchIntended(el, blur, event) {
    this.focused = false;
    if (blur) {
      this.blurHappened = true;
      setTimeout(() => {
        this.blurHappened = false;
      }, 200);
      if (el.value.length) {
        this.expanded = true;
        return;
      }
      this.expanded = false;
      return;
    }
    if (el.value.length && this.expanded) {
      this.expanded = true;
      this.writeValue(el.value);
      return;
    }
    if (!el.value.length && this.expanded) {
      this.expanded = false;
      return;
    }
    if (this.blurHappened && !this.expanded) {
      this.expanded = false;
      return;
    }
    if (!this.expanded && !this.blurHappened) {
      this.expanded = true;
      this.searchExpandableEl.nativeElement.focus();
    }
  }

  onFocus(event?: Event): void {
    this.expanded = true;
    this.focused = true;
  }

  onKeyUp(el): void {
    this.keyup.emit(el.value);
  }

  // onBlur(event, el): void {
  //   this.focused = false;
  //   // if (!el.value) {
  //   //   this.expanded = false;
  //   // }
  // }

  onTypingDynamic(el) {
    if (
      this.clearOnBlur &&
      (this.variant === SearchVariant.DYNAMIC ||
        this.variant === SearchVariant.CONTEXTUAL)
    ) {
      this.clearAssistMenuListing = false;
    }
    this.writeValue(el.value);
    if (el.value.length) {
      this.showClear = true;
      return;
    }
    this.showClear = false;
  }

  clearDynamicVal(el) {
    el.value = '';
    this.showClear = false;
    this.writeValue(el.value);
  }

  clearAssistMenu() {
    if (
      this.clearOnBlur &&
      (this.variant === SearchVariant.DYNAMIC ||
        this.variant === SearchVariant.CONTEXTUAL)
    ) {
      this.clearAssistMenuListing = true;
    }
  }

  assistListItemSelected(item, el) {
    this.assistSelection.emit(item[0]);
    this.clearDynamicVal(el);
  }

  writeValue(value: any) {
    super.writeValue(value);
    this.value = value;
    this.cdRef.detectChanges();
    if (
      this.variant === SearchVariant.DYNAMIC ||
      this.variant === SearchVariant.CONTEXTUAL
    ) {
      if (value.length >= this.assistLength) {
        this.search.emit({
          keyword: value,
        });
      }
      return;
    }
    this.search.emit({
      keyword: value,
    });
  }
}

