} from '@angular/core';
import { VdsLibService } from '../vds-lib.service';
import {
  SELECT,
  SelectOptionChange,
} from './select.constant';
import { isNumeric } from 'rxjs/internal-compatibility';
import {
  AbstractValueAccessor,
  MakeProvider,
} from '../abstract-value-accessor';
import { ErrorComponent } from '../error/error.component';

@Component({
  selector: 'vds-select',
  templateUrl: './select.component.html',
  providers: [MakeProvider(SelectComponent)],
  changeDetection: ChangeDetectionStrategy.OnPush,
})
export class SelectComponent extends AbstractValueAccessor
  implements OnInit, AfterContentChecked, OnChanges {
  /**
   * Disable select statically or programmatically. <br>
   * Use as attribute or input property. <br>
   * Default: <code>false</code>
   */
  @Input() disabled: boolean;
  /**
   * The id of the select element.
   */
  @Input() id: string;
  /**
   * Validation error for the select.
   */
  @Input() invalid: boolean;
  /**
   * The user display label of the select.
   */
  @Input() label: string;
  /**
   * Set as read-only statically or programmatically. <br>
   * Use as attribute or input property. <br>
   * Default: <code>false</code>
   */
  @Input() readonly: boolean;
  /**
   * The value of the select element.
   */
  @Input() value: string | number;
  /**
   * Emits <code>SimpleChange</code> of selected value.
   */
  @Output() change: EventEmitter<
    SimpleChange
  > = new EventEmitter();
  /**
   * Emits <code>SelectOptionChange</code> of selected value.
   */
  @Output()
  optionChange = new EventEmitter<SelectOptionChange>();

  @ViewChild('selectBar') selectBar: ElementRef;

  @ContentChildren(ErrorComponent) errors: QueryList<
    ErrorComponent
  >;

  public selectID: string;
  public selectFocusBoxWidth: number;
  public selectOptionsFocus = false;
  public groupError: boolean;
  public errorId: string;

  constructor(
    private cdRef: ChangeDetectorRef,
    private vdsLibService: VdsLibService
  ) {
    super();
  }

  ngOnInit() {
    this.id = this.id
      ? this.id
      : this.vdsLibService.getUUID(SELECT.PREFIX.ID);
    this.selectID = `${this.id}${SELECT.SUFFIX.NATIVE}`;
    this.disabled = this.vdsLibService.triageDisabledValue(
      this.disabled
    );
    this.readonly = this.vdsLibService.triageDisabledValue(
      this.readonly
    );
    this.writeValue(this.value);
  }

  ngOnChanges(changes: SimpleChanges): void {
    if (
      changes &&
      changes.invalid &&
      !changes.invalid.currentValue
    ) {
      this.errorId = null;
      this.cdRef.detectChanges();
    }
  }

  ngAfterContentChecked() {
    const errorComponent = this.errors.find(
      (item) => item.id != null
    );
    this.errorId =
      errorComponent && errorComponent.id && this.invalid
        ? errorComponent.id
        : null;
    this.cdRef.detectChanges();
  }

  writeValue(value: any) {
    value = isNumeric(value) ? Number(value) : value;
    super.writeValue(value);
    this.value = value;
    this.cdRef.detectChanges();
  }

  onSelectOptionChange(el) {
    const emitEvent = new SimpleChange(
      this.value,
      el.value,
      this.value === undefined
    );
    emitEvent.currentValue = isNumeric(
      emitEvent.currentValue
    )
      ? Number(emitEvent.currentValue)
      : emitEvent.currentValue;
    emitEvent.previousValue = isNumeric(
      emitEvent.previousValue
    )
      ? Number(emitEvent.previousValue)
      : emitEvent.previousValue;
    this.change.emit(emitEvent);
    this.optionChange.emit({
      source: this,
      value: emitEvent.currentValue,
    });
    this.writeValue(emitEvent.currentValue);
  }

  focusSelectOptions() {
    this.selectOptionsFocus = true;
    this.selectFocusBoxWidth = this.selectBar.nativeElement.clientWidth;
  }

  blurSelectOptions() {
    this.selectOptionsFocus = false;
  }
}

import {
  Component,
  EventEmitter,
  HostBinding,
  Input,
  OnDestroy,
  OnInit,
  Output,
  Renderer2,
  ViewChild,
} from '@angular/core';
import { VdsLibService } from '../vds-lib.service';
import {
  SLIDER_DEFAULT,
  SLIDER_NUMBER,
} from './slider.constants';
import { coerceNumberProperty } from '@angular/cdk/coercion';

@Component({
  selector: 'vds-slider',
  templateUrl: './slider.component.html',
})
export class SliderComponent implements OnInit, OnDestroy {
  /**
   * The label on the slider (Defaults to 'Slider control')
   */
  @Input() label: string;
  /**
   * The maximum value of the slider (Defaults to 100).
   */
  @Input() max: number;
  /**
   * The minimum value of the slider (Defaults to 0).
   */
  @Input() min: number;
  /**
   * The starting value of the slider (Defaults to min).
   */
  @Input() value: number;
  /**
   * The component is disabled or not (Defaults to false).
   */
  @Input() disabled: boolean;
  /**
   * The discrete flag sets discrete sliders (defaults to false to render a continuous slider).
   */
  @Input() discrete = false;
  /**
   * The tooltip is to display tooltip or not (Defaults to false).
   */
  @Input() tooltip = false;
  /**
   * Values displayed to mark significant portions of the slider for context.
   */
  @Input() markerValues: Array<string>;
  /**
   * Emits slider value on drag.
   */
  @Output() change: EventEmitter<
    number
  > = new EventEmitter();
  /**
   * Emits slider value on mouse up event.
   */
  @Output() select: EventEmitter<
    number
  > = new EventEmitter();

  SLIDER_NUMBER = SLIDER_NUMBER;
  SLIDER_DEFAULT = SLIDER_DEFAULT;
  focused = false;
  nodeValue: number;
  range: number;
  trackValue: number;
  trackWidth: number;
  trackX: number;
  showTooltip: boolean;
  id: string;
  discreteLeftValues = [];
  currentDiscreteKey: number;

  moveListener: () => void;
  upListener: () => void;

  @ViewChild('slider') slider: any;
  @ViewChild('track') track: any;

  constructor(
    private renderer: Renderer2,
    private vdsLibService: VdsLibService
  ) {}

  private checkEndpointLogic() {
    if (this.min > this.max) {
      this.max = this.min + 1;
    }
    this.range = this.max - this.min;
  }

  private position(event: MouseEvent | number) {
    const midpoint = this.discrete
      ? SLIDER_NUMBER.NODE.MIDPOINT
      : SLIDER_DEFAULT.NODE.MIDPOINT;
    switch (typeof event) {
      case 'number':
        if (this.discrete) {
          this.value = this.discreteLeftValues.includes(
            event
          )
            ? event
            : this.discreteLeftValues[0];
        }
        if (event > this.max) {
          event = this.max;
          this.value = event;
        }
        if (event < this.min) {
          event = this.min;
          this.value = event;
        }
        const percentage = (event - this.min) / this.range;
        this.trackValue = percentage * this.trackWidth;
        this.nodeValue = this.trackValue - midpoint;
        break;
      default:
        this.trackValue = event.x - this.trackX;
        if (this.discrete) {
          if (
            this.trackValue - midpoint >=
            this.discreteLeftValues[
              this.currentDiscreteKey + 1
            ]
          ) {
            this.nodeValue = this.trackValue - midpoint;
            if (
              this.discreteLeftValues[
                this.currentDiscreteKey + 1
              ]
            ) {
              this.value = this.discreteLeftValues[
                ++this.currentDiscreteKey
              ];
              this.change.emit(this.value);
            }
          }
          if (
            this.trackValue - midpoint <=
            this.discreteLeftValues[
              this.currentDiscreteKey - 1
            ]
          ) {
            this.nodeValue = this.trackValue - midpoint;
            if (
              this.discreteLeftValues[
                this.currentDiscreteKey - 1
              ] !== undefined
            ) {
              this.value = this.discreteLeftValues[
                --this.currentDiscreteKey
              ];
              this.change.emit(this.value);
            }
          }
        }
        if (!this.discrete) {
          this.nodeValue = this.trackValue - midpoint;
        }
    }
    if (this.trackValue <= -1) {
      this.trackValue = 0;
      this.nodeValue = 0 - midpoint;
      return;
    }
    if (this.trackValue >= this.trackWidth + 1) {
      this.trackValue = this.trackWidth;
      this.nodeValue = this.trackWidth - midpoint;
      return;
    }
    this.value =
      typeof event === 'number'
        ? this.value
        : Math.round(
            (this.trackValue / this.trackWidth) *
              (this.max - this.min) +
              this.min
          );
    if (this.value > this.max) {
      this.value = this.max;
    }
    if (this.value < this.min) {
      this.value = this.min;
    }
    if (!this.discrete) {
      this.change.emit(this.value);
    }
  }

  private clearListeners() {
    if (this.upListener) {
      this.upListener();
      delete this.upListener;
    }
    if (this.moveListener) {
      this.moveListener();
      delete this.moveListener;
    }
  }

  ngOnInit() {
    this.id = this.id
      ? this.id
      : this.vdsLibService.getUUID();

    this.max = this.max
      ? coerceNumberProperty(this.max)
      : 100;
    this.min = this.min
      ? coerceNumberProperty(this.min)
      : 0;
    this.value = this.value
      ? coerceNumberProperty(this.value)
      : this.min;
    this.checkEndpointLogic();
    const coords = this.vdsLibService.getBoundingBoxAndCoords(
      this.slider.nativeElement
    );
    this.disabled = this.vdsLibService.triageDisabledValue(
      this.disabled
    );
    this.discrete = this.vdsLibService.triageDisabledValue(
      this.discrete
    );
    this.tooltip = this.vdsLibService.triageDisabledValue(
      this.tooltip
    );
    this.trackX = coords.left;
    this.trackWidth = coords.width;
    if (this.value || this.value === 0) {
      this.position(this.value);
    }
    if (this.discrete && this.markerValues) {
      this.setDiscreteLeftValues();
    }
  }

  ngOnDestroy() {
    this.clearListeners();
  }

  setDiscreteLeftValues(): void {
    const increments =
      this.trackWidth / (this.markerValues.length - 1);
    let i = 0;
    this.discreteLeftValues = [];
    this.markerValues.forEach(() => {
      this.discreteLeftValues[i] = increments * i;
      i++;
    });
    this.currentDiscreteKey = this.value
      ? this.value
      : this.discreteLeftValues[0];
  }

  onMousedown(): void {
    this.moveListener = this.renderer.listen(
      'document',
      'mousemove',
      (event: MouseEvent) => {
        this.position(event);
      }
    );
    this.upListener = this.renderer.listen(
      'document',
      'mouseup',
      (event: MouseEvent) => {
        this.onMouseup();
      }
    );
  }

  private incrementDiscrete(): void {
    if (
      this.discreteLeftValues[this.currentDiscreteKey + 1]
    ) {
      this.value = this.discreteLeftValues[
        ++this.currentDiscreteKey
      ];
    }
    this.change.emit(this.value);
  }

  private decrementDiscrete(): void {
    if (this.discreteLeftValues[this.currentDiscreteKey]) {
      this.value = this.discreteLeftValues[
        --this.currentDiscreteKey
      ];
    }
    this.change.emit(this.value);
  }

  onMouseup(): void {
    this.select.emit(this.value);
    this.clearListeners();
    this.focused = false;
  }

  onFocus(): void {
    this.focused = true;
  }

  onBlur(): void {
    this.focused = false;
  }
  onArrowDown(e): void {
    switch (e.key) {
      case 'ArrowRight':
        if (this.discrete) {
          this.incrementDiscrete();
          this.position(this.value);
          break;
        }
        this.position(this.value++);
        break;
      case 'ArrowLeft':
        if (this.discrete) {
          this.decrementDiscrete();
          this.position(this.value);
          break;
        }
        this.position(this.value--);
        break;
    }
  }

  getTicks(): string {
    if (!this.markerValues) {
      console.warn(
        '[NG VDS] slider missing markerValues property!'
      );
      return `${SLIDER_NUMBER.TICKS[0]}px 4px`;
    }
    return `${
      SLIDER_NUMBER.TICKS[this.markerValues.length]
    }px 4px`;
  }
}

