import { Component, OnInit, Input } from '@angular/core';
import { LARGE, SMALL } from './spinner-progress.constants';

@Component({
  selector: 'vds-spinner-progress',
  templateUrl: './spinner-progress.component.html',
})
export class SpinnerProgressComponent implements OnInit {
  /**
   * Sets the type of progress bar. (defaults to false)
   */
  @Input() determinate = false;
  /**
   * Sets the percentage for a *determinate* spinner.
   */
  @Input() percentage = 0;
  /**
   * Sets the size of the element (defaults to large).
   */
  @Input() size = 'large';

  calculatedOffset: number;
  // todo fix this. there needs to be a default
  sizeObj: any;

  constructor() {}

  ngOnInit() {
    this.setSize();
    if (this.determinate) {
      this.setOffset();
    }
  }

  setSize() {
    switch (this.size.toLowerCase()) {
      case 'small':
        this.sizeObj = SMALL;
        break;
      case 'large':
        this.sizeObj = LARGE;
        break;
      default:
        this.sizeObj = LARGE;
        break;
    }
  }

  setOffset() {
    if (this.percentage < 0) {
      this.percentage = 0;
    }
    if (this.percentage > 100) {
      this.percentage = 100;
    }
    this.calculatedOffset =
      this.sizeObj.STROKE_DASHARRAY -
      this.percentage *
        0.01 *
        this.sizeObj.STROKE_DASHARRAY;
  }
}

import {
  Component,
  OnInit,
  Input,
  ViewChild,
  ElementRef,
  AfterViewInit,
  HostListener,
  EventEmitter,
  Output,
} from '@angular/core';
import { STEP } from './step.constants';
import { StepStatus } from './step.constants';
import { coerceBooleanProperty } from '@angular/cdk/coercion';

@Component({
  selector: 'vds-step',
  templateUrl: './step.component.html',
})
export class StepComponent
  implements OnInit, AfterViewInit {
  constructor(public el?: ElementRef) {}
  /**
   * Label for each step (numbers or roman numerals).
   */
  @Input() label: string;
  /**
   * Message displayed in tooltip.
   */
  @Input() tooltip = '';
  /**
   * If set, allows clicking of step number to route in the wizard
   */
  @Input() enableClick: boolean;
  /**
   * Title for each step.
   */
  @Input() title = '';
  /**
   * Status of the step.
   */
  @Input() status: StepStatus;
  /**
   * ARIA label for accessibility.
   */
  @Input() ariaLabel: string;
  /**
   * Emits zero-based step index of the clicked step.
   */
  @Output() clicked: EventEmitter<any> = new EventEmitter();

  @ViewChild('tooltipReference') tooltipRef: ElementRef;
  @ViewChild('tooltipText') tooltipText: ElementRef;
  @ViewChild('step') step: HTMLElement;

  STEPID = '';
  isShowing = false;
  isActive = false;
  isCompleted = false;
  hasError = false;
  errorSymbol = STEP.DEFAULT.ERROR;
  next: StepComponent | null = null;
  prev: StepComponent | null = null;
  number = '';

  // @TODO: Remove tooltip JS - needs to be handled by the tooltip component
  @HostListener('window:resize', [])
  onResize() {
    this.setTooltipPosition();
  }

  ngOnInit() {
    this.enableClick = coerceBooleanProperty(
      this.enableClick
    );
    if (this.status) {
      switch (this.status.toLowerCase()) {
        case StepStatus.COMPLETE:
          this.isCompleted = true;
          break;
        case StepStatus.ERROR:
          this.hasError = true;
          break;
        case StepStatus.ACTIVE:
          this.isActive = true;
          break;
        default:
          this.hasError = false;
          this.isActive = false;
          this.isCompleted = false;
          break;
      }
    }
  }

  // @TODO: Remove tooltip JS - needs to be handled by the tooltip component
  private setTooltipPosition() {
    const itemLeft = this.el.nativeElement.firstElementChild
      .offsetLeft;
    const itemHeight = this.el.nativeElement
      .firstElementChild.offsetHeight;
    const itemTop = this.el.nativeElement.firstElementChild
      .offsetTop;

    if (this.tooltipRef) {
      this.tooltipRef.nativeElement.style.top =
        itemTop - itemHeight + STEP.DEFAULT.UNITS;
      this.tooltipRef.nativeElement.style.left =
        itemLeft + STEP.DEFAULT.UNITS;
    }
  }

  ngAfterViewInit() {
    this.setTooltipPosition();
  }

  show() {
    this.isShowing = true;
  }

  hide() {
    this.isShowing = false;
  }

  activate() {
    this.isActive = true;
  }

  resetActivate() {
    this.isActive = false;
  }

  deactivate() {
    this.isActive = false;
    this.hasError = false;
    this.isCompleted = false;
  }

  complete(success?: boolean) {
    this.isActive = false;
    this.isCompleted = success;
    this.hasError = !success;
  }

  emitClickedStep(stepBtn) {
    if (this.enableClick) {
      this.clicked.emit(stepBtn.number - 1);
    }
  }
}

