} from './switch.constant';

@Component({
  selector: 'vds-switch',
  templateUrl: './switch.component.html',
})
export class SwitchComponent implements OnInit {
  /**
   * The id of the input element.
   */
  @Input() id: string;
  /**
   * Adds accessible label.
   */
  @Input() label: string;
  /**
   * Checks the switch statically or programmatically. <br>
   * Use as attribute or input property. <br>
   * Default: <code>false</code>
   */
  @Input() checked: boolean;
  /**
   * Disable checkbox statically or programmatically. <br>
   * Use as attribute or input property. <br>
   * Default: <code>false</code>
   */
  @Input() disabled: boolean;
  /**
   * The name of the input element.
   */
  @Input() name: string;
  /**
   * Sets custom checked label. <br>
   * Defaults to 'on'
   */
  @Input() checkedLabel: string = CHECKED_LABEL_DEFAULT.on;
  /**
   * Sets custom unchecked label. <br>
   * Defaults to 'off'
   */
  @Input() uncheckedLabel: string =
    CHECKED_LABEL_DEFAULT.off;
  /**
   * Emits change event.
   */
  @Output() change: EventEmitter<any> = new EventEmitter();

  public currentState: string;
  public focused = false;
  public switchID: string;
  public switchName: string;

  constructor(private vdsLibService: VdsLibService) {}

  ngOnInit() {
    this.id = this.id
      ? this.id
      : this.vdsLibService.getUUID(SWITCH.PREFIX.ID);
    this.name = this.name
      ? this.name
      : this.id + SWITCH.SUFFIX.NAME;
    this.switchID = `${this.id}${SWITCH.SUFFIX.NATIVE}`;
    this.switchName = `${this.name}${SWITCH.SUFFIX.NATIVE}`;
    this.checked = this.vdsLibService.triageDisabledValue(
      this.checked
    );
    this.disabled = this.vdsLibService.triageDisabledValue(
      this.disabled
    );
  }

  click(event?: any): void {
    event.stopPropagation();
    event.preventDefault();
    if (!this.disabled) {
      this.checked = !this.checked;
    }
    this.change.emit({
      checked: this.checked,
      disabled: this.disabled,
    });
  }

  onFocus(): void {
    this.focused = true;
  }

  onBlur(): void {
    this.focused = false;
  }
}

