@Component({
  selector: 'vds-tab',
  templateUrl: './tab.component.html',
})
export class TabComponent implements OnInit, AfterViewInit {
  /**
   * Disable tab statically or programmatically.
   * Use as attribute or input property.
   */
  @Input() disabled: boolean;
  /**
   * Used for link tabs to route to another page.
   */
  @Input() href: string;
  /**
   * Used for setting the icon in the tab.
   */
  @Input() icon: string;
  /**
   * Route within the app.
   */
  @Input() route: boolean;

  /**
   * active = true loads the tab content. active = false hides the tab content.
   * Parent Tabs component use only.
   */
  public active: boolean;
  /**
   * The <code>title</code> is set implicitly from content of element.
   * Parent Tabs component use only; uses this to set the tab title.
   */
  private title: string;

  constructor(
    private elem: ElementRef,
    private vdsLibService: VdsLibService
  ) {}

  ngOnInit() {
    this.disabled = this.triageDisabledValue();
    this.title = this.elem.nativeElement.innerHTML;
    this.route = this.vdsLibService.triageDisabledValue(
      this.route
    );
  }

  ngAfterViewInit() {
    this.title = this.elem.nativeElement.innerHTML;
  }

  triageDisabledValue(): boolean {
    const disabledStr = String(this.disabled).toLowerCase();
    return !(
      disabledStr === 'undefined' ||
      disabledStr === 'null' ||
      disabledStr === 'false'
    );
  }
}

import {
  Component,
  OnInit,
  ContentChildren,
  QueryList,
  AfterContentInit,
  Input,
  Output,
  EventEmitter,
  ViewChildren,
} from '@angular/core';
import { TabComponent } from '../tab/tab.component';
import { Router } from '@angular/router';

@Component({
  selector: 'vds-tabs',
  templateUrl: './tabs.component.html',
  styleUrls: ['./tabs.component.scss'],
})
export class TabsComponent
  implements OnInit, AfterContentInit {
  @ViewChildren('tabButton') tabButtons: QueryList<any>;
  @ContentChildren(TabComponent) tabs: QueryList<
    TabComponent
  >;

  /**
   * Programmatically set the selectedIndex. Default: 0.
   */
  @Input() selectedIndex: number | null = 0;
  /**
   * Type of tabs. Default:
   * <code>link. [link|button|menu|icon|iconLabel|iconMenu]</code>
   */
  @Input() type = 'link';
  /**
   * Emits the index of selected tab. Zero-based.
   */
  @Output() readonly selectedIndexChange: EventEmitter<
    number
  > = new EventEmitter<number>();

  focusedTabIndex: number | null;

  constructor(private router: Router) {}

  ngOnInit() {}

  selectTab(index) {
    index = parseInt(index, 10);
    if (this.tabs) {
      if (index === this.selectedIndex) {
        return;
      }
      if (
        this.tabs.toArray()[index] &&
        this.tabs.toArray()[index].disabled
      ) {
        return;
      }

      this.tabs
        .toArray()
        .forEach((tab) => (tab.active = false));
      if (this.tabs.toArray()[index]) {
        this.selectedIndex = index;
        this.tabs.toArray()[index].active = true;
        this.selectedIndexChange.emit(this.selectedIndex);
      }
    }
  }

  ngAfterContentInit() {
    if (this.tabs) {
      this.tabs.toArray().forEach((tab, index) => {
        if (tab.route && tab.href === this.router.url) {
          this.selectedIndex = index;
        }
      });
      setTimeout(() => {
        this.selectTab(
          this.selectedIndex ? this.selectedIndex : 0
        );
      }, 0);
    }
  }

  focusPrevious() {
    if (this.focusedTabIndex != null) {
      this.focusedTabIndex =
        this.focusedTabIndex === 0
          ? this.focusedTabIndex
          : this.focusedTabIndex - 1;
      this.tabButtons
        .toArray()
        [this.focusedTabIndex].nativeElement.focus();
    }
  }

  focusNext() {
    if (this.focusedTabIndex != null) {
      this.focusedTabIndex =
        this.focusedTabIndex === this.tabButtons.length - 1
          ? this.focusedTabIndex
          : this.focusedTabIndex + 1;
      this.tabButtons
        .toArray()
        [this.focusedTabIndex].nativeElement.focus();
    }
  }

  onTabFocus(index: number) {
    this.focusedTabIndex = index;
  }
}

