import {
  Component,
  Input,
  OnInit,
  Output,
  EventEmitter,
  ViewChild,
  ElementRef,
  AfterViewInit,
  ChangeDetectionStrategy,
  ChangeDetectorRef,
  AfterContentChecked,
  ContentChildren,
  QueryList,
  forwardRef,
} from '@angular/core';
import { VdsLibService } from '../vds-lib.service';
import { TEXT_FIELD } from './text-field.constant';
import {
  AbstractValueAccessor,
  MakeProvider,
} from '../abstract-value-accessor';
import { CharacterCounter } from '../character-counter/character-counter.constants';
import { ErrorComponent } from '../error/error.component';
import {
  FormControl,
  NG_VALIDATORS,
  Validator,
} from '@angular/forms';
import { coerceBooleanProperty } from '@angular/cdk/coercion';

@Component({
  selector: 'vds-text-field',
  templateUrl: './text-field.component.html',
  providers: [
    MakeProvider(TextFieldComponent),
    {
      provide: NG_VALIDATORS,
      useExisting: forwardRef(() => TextFieldComponent),
      multi: true,
    },
  ],
  changeDetection: ChangeDetectionStrategy.OnPush,
})
export class TextFieldComponent
  extends AbstractValueAccessor
  implements
    OnInit,
    AfterViewInit,
    AfterContentChecked,
    Validator {
  /**
   * Sets text area to auto grow statically or programmatically. <br>
   * Use as attribute or input property. <br>
   * Default: <code>false</code>
   */
  @Input() autoGrow: boolean;
  /**
   * Character Counter typed interface to specify limit and message.
   */
  @Input() characterCounter: CharacterCounter;
  /**
   * Disable select statically or programmatically. <br>
   * Use as attribute or input property. <br>
   * Default: <code>false</code>
   */
  @Input() disabled: boolean;
  /**
   * The text that articulates the purpose to the user.
   */
  @Input() helpText: string;
  /**
   * Hint of value to guide the user.
   */
  @Input() hint: string;
  /**
   * The id of the element.
   */
  @Input() id: string;
  /**
   * The user display label of the text-field.
   */
  @Input() label: string;
  /**
   * Set as multiline statically or programmatically. <br>
   * Use as attribute or input property. <br>
   * Default: <code>false</code>
   */
  @Input() multiline: boolean;
  /**
   * The name of the text-field element.
   */
  @Input() name: string;
  /**
   * Placeholder for text input.
   */
  @Input() placeholder: string;
  /**
   * Set as read-only statically or programmatically. <br>
   * Use as attribute or input property. <br>
   * Default: <code>false</code>
   */
  @Input() readOnly: boolean;
  /**
   * Set as required statically or programmatically. <br>
   * Use as attribute or input property. <br>
   * Default: <code>false</code>
   */
  @Input() required: boolean;
  /**
   * Toggle check mark usage statically or programmatically. <br>
   * Use as attribute or input property. <br>
   * Default: <code>false</code>
   */
  @Input() showCheckMark: boolean;
  /**
   * The native type of the element.
   */
  @Input() type: string;
  /**
   * Validate and surface the errors on load with styling and messaging. <br>
   * Applies to Reactive Forms.
   */
  // @Input() validateOnLoad: boolean;
  @Input()
  get validateOnLoad(): boolean {
    return this._validateOnLoad;
  }
  set validateOnLoad(value) {
    this._validateOnLoad = coerceBooleanProperty(value);
  }
  _validateOnLoad = false;
  /**
   * The value of the element.
   */
  @Input() value: string;
  /**
   * Emits blur event.
   */
  @Output() blur = new EventEmitter<any>();
  /**
   * Emits changed value.
   */
  @Output() change = new EventEmitter<any>();
  /**
   * Emits error object.
   */
  @Output() error = new EventEmitter<any>();
  /**
   * Emits focus event.
   */
  @Output() focus = new EventEmitter<any>();

  @ViewChild('theInput') input: ElementRef;

  @ContentChildren(ErrorComponent) errors: QueryList<
    ErrorComponent
  >;

  public focused = false;
  public preFilledContent: boolean;
  public remainingCount = 0;
  public textFieldID: string;
  public textFieldName: string;
  public textFieldMessage: string;
  public ariaDescribedBy: string;
  public invalidity: boolean;
  public isTextFieldValid = true;

  private initialValue: string;
  private inputEl: any;
  private latestValidateErrors: any;
  private tighterTextArea = 10;

  constructor(
    private vdsLibService: VdsLibService,
    private cdRef: ChangeDetectorRef
  ) {
    super();
  }

  ngOnInit() {
    this.id = this.id
      ? this.id
      : this.vdsLibService.getUUID(TEXT_FIELD.PREFIX.ID);
    this.name = this.name
      ? this.name
      : this.id + TEXT_FIELD.SUFFIX.NAME;
    this.autoGrow = this.vdsLibService.triageDisabledValue(
      this.autoGrow
    );
    this.disabled = this.vdsLibService.triageDisabledValue(
      this.disabled
    );
    this.multiline = this.vdsLibService.triageDisabledValue(
      this.multiline
    );
    this.required = this.vdsLibService.triageDisabledValue(
      this.required
    );
    this.readOnly = this.vdsLibService.triageDisabledValue(
      this.readOnly
    );
    this.showCheckMark = this.vdsLibService.triageDisabledValue(
      this.showCheckMark
    );
    this.textFieldID = `${this.id}${
      TEXT_FIELD.SUFFIX.NATIVE
    }`;
    this.textFieldName = `${this.name}${
      TEXT_FIELD.SUFFIX.NATIVE
    }`;
    this.textFieldMessage = `${this.id}${
      TEXT_FIELD.SUFFIX.MESSAGE
    }`;
    this.ariaDescribedBy = this.textFieldMessage;
    if (
      this.characterCounter &&
      this.characterCounter.limit
    ) {
      this.remainingCount = this.characterCounter.limit;
      this.characterCounter.remainder = this.remainingCount;
      this.cdRef.detectChanges();
    }
    this.writeValue(this.value);
    this.change.emit(this.value);
  }

  ngAfterViewInit() {
    this.inputEl = this.input.nativeElement;
    if (this.autoGrow) {
      setTimeout(() => {
        this.resizeTextarea();
      }, 1);
    }
    this.initialValue = this.value;
    this.preFilledContent = !!this.initialValue;
  }

  ngAfterContentChecked() {
    if (!this.invalidity) {
      this.ariaDescribedBy = this.textFieldMessage;
      return;
    }
    const errorComponent = this.errors.find(
      (item) => item.id != null
    );
    if (errorComponent && errorComponent.id) {
      this.ariaDescribedBy = errorComponent.id;
    }
  }

  onFocus(ev?: Event): void {
    if (this.readOnly || this.disabled) {
      return;
    }
    this.focused = true;
    this.onTouched();
    this.focus.emit(ev);
  }

  public validate(c: FormControl) {
    this.isTextFieldValid =
      c.pristine && !this.validateOnLoad ? true : !c.errors;
    this.latestValidateErrors = c.errors;
    this.cdRef.detectChanges();
    if (c && c.errors) {
      this.error.emit(c.errors);
      return {};
    }
    return null;
  }

  onBlur(ev?: Event): void {
    if (this.readOnly || this.disabled) {
      return;
    }
    this.focused = false;
    if (
      this.preFilledContent &&
      this.initialValue &&
      this.value !== this.initialValue
    ) {
      this.preFilledContent = false;
    }
    if (this.latestValidateErrors) {
      this.isTextFieldValid = false;
    }
    this.blur.emit(ev);
    this.change.emit(this.value);
  }

  onTyping(el) {
    this.validityChecks(el);
    this.writeValue(this.value);
    if (this.characterCounter) {
      const currentLength: number = this.inputEl.value
        .length;
      this.remainingCount =
        this.characterCounter.limit - currentLength;
      this.characterCounter.remainder = this.remainingCount;
      this.cdRef.detectChanges();
    }
    if (this.autoGrow) {
      setTimeout(() => {
        this.resizeTextarea();
      }, 1);
    }
  }

  validityChecks(el) {
    if (el.invalid) {
      this.invalidity = true;
      this.isTextFieldValid = false;
      this.error.emit(el.errors);
    }
    if (!el.invalid) {
      this.isTextFieldValid = true;
      this.invalidity = false;
    }
    this.cdRef.detectChanges();
  }

  writeValue(value: any) {
    super.writeValue(value);
    this.value = value;
    this.cdRef.detectChanges();
    this.change.emit(this.value);
  }

  reset() {
    this.value = this.initialValue;
    this.writeValue(this.value);
    this.change.emit(this.value);
  }

  clear() {
    this.value = null;
    this.writeValue(this.value);
    this.change.emit(this.value);
  }

  resizeTextarea(): void {
    if (window) {
      this.inputEl.style.height = 'inherit';
      this.inputEl.style.height =
        this.inputEl.scrollHeight -
        this.tighterTextArea +
        'px';
    }
  }
}

