import {
  AfterContentInit,
  Component,
  ContentChildren,
  EventEmitter,
  Input,
  OnInit,
  Output,
  QueryList,
} from '@angular/core';
import { TOGGLEBUTTON } from './toggle-button-set.constants';
import { ToggleButtonComponent } from '../toggle-button.component';
import { VdsLibService } from '../../vds-lib.service';

@Component({
  selector: 'vds-toggle-button-set',
  templateUrl: './toggle-button-set.component.html',
})
export class ToggleButtonSetComponent
  implements OnInit, AfterContentInit {
  /**
   * The legend label for a group of toggle buttons.
   */
  @Input() get label(): string {
    return this._label;
  }
  set label(value: string) {
    this._label = value;
  }
  private _label: string;
  /**
   * Shared name for a group of toggle buttons.
   */
  @Input() get name(): string {
    return this._name;
  }
  set name(value: string) {
    this._name = value;
  }
  private _name: string;
  /**
   * Emits the child toggle button's value property when selected.
   */
  @Output() select: EventEmitter<
    string
  > = new EventEmitter();

  @ContentChildren(ToggleButtonComponent)
  buttons: QueryList<ToggleButtonComponent>;

  _buttons: Array<ToggleButtonComponent> = [];
  selectedToggleButton: ToggleButtonComponent;
  focusedToggleButton: ToggleButtonComponent;

  constructor(private vdsLibService: VdsLibService) {}

  ngOnInit() {
    this.label = this.label
      ? this.label
      : TOGGLEBUTTON.DEFAULT.LABEL;
    this.name = this.name
      ? this.name
      : `${
          TOGGLEBUTTON.DEFAULT.NAME_PREFIX
        }${this.vdsLibService.getUUID()}`;
  }

  ngAfterContentInit() {
    this._buttons = this.buttons.toArray();
    this._buttons.forEach(
      (button: ToggleButtonComponent) => {
        if (this.selectedToggleButton && button.checked) {
          button.checked = false;
          console.warn(
            '[VDS NG] Toggle-Button has multiple preselected values. Defaults to first value.'
          );
        }
        if (button.checked) {
          this.selectedToggleButton = button;
          this.select.emit(this.selectedToggleButton.value);
        }
      }
    );
  }

  onBlur() {
    if (this.focusedToggleButton) {
      this.focusedToggleButton.focused = false;
      this.focusedToggleButton = null;
    }
  }

  onFocus(button: ToggleButtonComponent) {
    if (this.focusedToggleButton) {
      this.focusedToggleButton.focused = false;
    }
    this.focusedToggleButton = button;
    this.focusedToggleButton.focused = true;
  }

  selectButton(
    button: ToggleButtonComponent,
    event: MouseEvent
  ) {
    if (event.pageX && this.focusedToggleButton) {
      this.focusedToggleButton.focused = false;
      this.focusedToggleButton = null;
    }
    if (this.selectedToggleButton) {
      this.selectedToggleButton.checked = false;
    }
    this.selectedToggleButton = button;
    this.selectedToggleButton.checked = true;
    this.select.emit(this.selectedToggleButton.value);
  }
}

